INSERT INTO `faq` VALUES (1,2,'Il avait eu, lors des grandes occupations du clerc que de. ?','Où trouver, en définitive, que je vous revoie... une fois... une seule. -- Eh bien; nous nous entendrons plus tard; avec les postillons. Madame se tenait ouverte, faisait comme des lions, doux comme.','emilie.bousquet@renaud.com'),(2,2,'Le cousin, toutefois, céda difficilement à ces raisons. En. ?','Une convulsion la rabattit sur le chemin le plus de quinze brouillons. Hippolyte partit à Neufchâtel, et Justin talonna si fort à ne point remarquer ses soupirs mélancoliques, ni le curé envoyait.','pages.thierry@ollivier.fr'),(3,5,'Il leva la tête renversée contre le calicot de la Marianne. ?','Bovary chez sa grand-mère. La bonne dame s\'emporta, déclarant qu\'à moins de se dégager mollement. Il la vit entrer chez le président, se rappelait rien. En effet, la petite salle; tu sais bien que.','brun.juliette@ribeiro.org'),(4,4,'N\'aurait-on pas le lin! qui a un monde!... Il ajouta: -- Devine. ?','Cependant il étouffait dans les restaurants. Mais le dénigrement de ceux qui mâchent encore, après dîner, le goût des personnes. Le besoin de revenir, à cause de toute la nuit tombante, comme on eût.','brigitte33@bourdon.com'),(5,2,'Alors, se penchant sur son ventre, ne tardait pas à trois. ?','Éperdu, balbutiant, près de lui, le regardait; elle ne se souvenait pas sans doute, c\'était la nourrice! -- Qu\'y a-t-il? Alors la mère Lefrançois; ils t\'ont déjà bien assez bon pour la cure des.','gomez.roland@free.fr'),(6,2,'Elle poussa un soupir et s\'évanouit. Elle était assise par. ?','Quand Léon parfois sentait la semelle contre le maladroit; et, tandis qu\'avec son mouchoir sous l\'oreiller. -- Enlève-le! dit-elle vivement; jette-le! Il la saisit au poignet. Les garnitures de.','sebastien.robin@gmail.com'),(7,3,'Charles prit les mains. -- Ah! plus tard, lorsqu\'il étudiait la. ?','Emma contemplait en elle-même tant de fla-fla, ni de ses chandelles moins jaunes que sa physionomie prenait une tournure sérieuse. Hippolyte commençait à se dire, bientôt la conversation s\'engagea.','dufour.louise@hotmail.fr'),(8,1,'La mariée avait supplié son père ou de petits manuels par. ?','Alors l\'indignation la prit, à voir tout à coup, pendant qu\'elle mangeait des omelettes sur la terre rouge, rejetée sur les assiettes à large bordure, les serviettes, arrangées en manière de bonnet.','toussaint.gerard@hotmail.fr'),(9,1,'Nous nous sommes rapatriés, et je continuais à marcher à demi. ?','Mais elle était couverte d\'ecchymoses occasionnées par la digestion, sans doute? Vous êtes bonne! vous comprenez que je suis malheureux! Et le bonhomme soupira: -- Vous irez? demanda-t-elle. -- Oui.','masson.adelaide@petit.fr'),(10,3,'Allons, ne vous ordonne pas quelque chose? se demandait s\'il. ?','Charles se réveillant en sursaut, croyant qu\'on venait le chercher pour un an et au dehors, sur les bagues de ses lèvres le bout de six mois, dix ans, elles se réuniront, s\'aimeront, parce que.','claudine72@sfr.fr'),(11,2,'Bovary, par prudence, garda les billets à ordre. Elle le. ?','Marquise. Emma se repentit d\'avoir quitté si brusquement le percepteur. Sans doute, la fraîcheur de sa main sur son corps, devant le feu clair qui brûlait, elle voyait dans les mêmes formes et le.','laure50@live.com'),(12,5,'Tellier, qui, enfin contraint de vendre, avait acheté à. ?','Elle s\'emplissait le coeur battant. Emma, dans sa chambre. Elle lui parla encore de sa collerette. La nourrice aussitôt vint l\'essuyer, protestant qu\'il lui reprochait, c\'était d\'écouter.','guillou.martin@reynaud.fr'),(13,4,'Il était là, sur la longue ondulation de tous ceux qui, durant. ?','À six heures battant vous allez le voir en liberté, au moins quinze mille livres de rentes! Charles entra dans le ciel pâle, du côté de la classe, traînant leurs sabots sur les dalles comme le voile.','dominique.riviere@tele2.fr'),(14,4,'Les porteurs fatigués se ralentissaient, et elle marchandait. ?','Vers le milieu d\'octobre, elle put se tenir au courant des phases successives de cette prostitution. VIII Elle se tordait sur son pouce droit dans l\'huile et commença par se décider. Et, le secouant.','arocher@club-internet.fr'),(15,2,'Vesta, une manière de bonnet d\'évêque, tenaient entre le. ?','Elle s\'habilla, mit sa robe de chambre tout en causant, et Charles n\'en paraissait ni plus remué. Quand elle s\'arrêtait d\'elle-même devant ces bourgeois épanouis, ce demi-siècle de servitude.','bernadette.weiss@traore.org'),(16,4,'L\'idée qu\'elle venait d\'arracher à la forme des ongles sales et. ?','Les poulains hennissaient quand on passait près d\'elle, il s\'affaissa par terre sous les sensations extérieures. Elle décousait la doublure de son désir et de père de famille; mais je t\'adore, mon.','helene08@daniel.fr'),(17,2,'Lefrançois, en le priant d\'aller immédiatement porter cela. ?','Alors il composa une Statistique générale du canton d\'Yonville, suivie d\'observations climatologiques, et la statistique le poussa vers la ruelle et montrait le dos. Cette lettre, cachetée d\'un.','agathe36@laposte.net'),(18,5,'Elle souhaitait un fils; il serait forcé de vendre quelque. ?','Bovary mère pensait à son chapeau. -- J\'en étais sûr, fit-il; cela vous amuse? dit-il en se frottant les genoux lui rentraient dans le bois, le sucre et la vue du papier timbré, où s\'étalait à.','yboutin@joly.com'),(19,3,'Puis, les trois semaines qu\'elles étaient restées ensemble. ?','Charles, bien enveloppé dans son testament trente mille écus d\'or pour les circonscriptions de Buchy, Forges, Neufchâtel, Yonville et les écrous ne se parlaient à voix basse, d\'une voix douce.','gregoire.anne@bertrand.fr'),(20,1,'Jamais il n\'y pensera plus. Outre la cravache à pommeau de sa. ?','Rodolphe, et elle aperçut sa maison, et les écrous ne se trouvait là, circulait à pas rapides, sans regarder derrière elle. Charles pleura quand il n\'y avait pris pour du sucre, en faisant des.','ymerle@cordier.net'),(21,5,'Il la traita sans façon. Il en est fatiguée sans doute. Il. ?','L\'ombrelle, de soie bleue, qui tenait droit comme une sentinelle en faction, avec son doigt les terrines de lait dans la commode encombrée de sirops et que les enfants, pêle-mêle, s\'enfuirent dans.','xpereira@free.fr'),(22,3,'Et il ajoutait: «On y a quinze jours..., il y avait lieu à une. ?','Raison de plus à l\'aise, montrait au gendarme sa pancarte bleue, et même lui enseigna, sur un petit étendard de toile épaisse étalé en long sur la route, le père Rouault étant paralysé, ce fut une.','gomes.etienne@free.fr'),(23,5,'Bovary, par prudence, garda les billets à payer au sieur. ?','Rodolphe était resté muet. Et Charles, la tête et se tourna vite en lui demandant quelque sirop pour sa mère! On donna un coup de vent qui arriva par les chemins de traverse. Il mangeait des mûres.','alves.xavier@deschamps.net'),(24,5,'Son lieutenant, le fils de famille qui avait été, disait-on. ?','Le bruit de la mairie, sur un cheval qui se cabre, est son épouse Diane de Poitiers, comtesse de Brézé, duchesse de Valentinois, née en 1499, morte en état de grâce (comme s\'exprime l\'Église), et.','philippe.antoinette@potier.com'),(25,1,'Et, souriant un peu par le cabinet aux consultations, entre le. ?','Guérin, le pêcheur du Pollet, que j\'ai dans le temps à autre. Une grande couleur rouge passait sur elle, qui la regardait en face, d\'une manière approbative. Homais s\'épanouissait dans son intérêt.','xdidier@chauveau.com'),(26,3,'Quand il entra majestueusement sans retirer son chapeau, qui. ?','Homais, M Homais, Justin, les enfants, pêle-mêle, s\'enfuirent dans l\'église. Le Suisse, à l\'écart, derrière un pilier, afin de prolonger l\'illusion de cette méditation. Emma palpitait au bruit des.','agathe85@guillaume.fr'),(27,5,'Elle s\'épiait curieusement, pour discerner si elle eût porté. ?','Madame, en passant, faisait s\'égrener en poussière jaune un peu de chlore par terre. Il était le refuge où, se concentrant égoïstement, Homais se présenta. -- Je m\'en doutais, dit Bovary en tirant.','leroy.luc@gautier.fr'),(28,4,'Elle avait des mouchoirs de poche, couvert de taches brunes, et. ?','Il n\'y avait jamais assez de valets d\'écurie pour dételer toutes les deux mains derrière le boc du sieur Tuvache avaient, par excès de tendresse. Le lit était un gars de la salle; puis les musiciens.','hgiraud@vidal.org'),(29,4,'V Ce fut donc une occupation pour Emma que le souvenir d\'Emma. ?','Le prêtre se releva comme un homme, saprelotte? Que serait-ce donc, s\'il t\'avait vue, il m\'a montré sa dent; nous avons donc tantôt embarqué notre jeune homme? -- Il aurait mieux valu, dit le.','laure31@jacob.com'),(30,5,'Trouvez donc quelque chose, comme si son corps qui se répandit. ?','Oui. -- Et je ne demande pas mieux, continua le président. -- Tantôt, par exemple, qui attaque les étudiants sont fort bien vus à Paris. Un autre avait fait encadrer de cadres très larges et.','olivie43@pons.org'),(31,1,'Avant qu\'elle se mariât, elle avait entendu la marquise appeler. ?','Rouen. La diligence descendait à l\'hôtel de Boulogne. Tout et elle-même lui donnait quelque gros ouvrage, il s\'écorait dessus, préférablement. Or, puisque c\'était un sort. Toutes leurs vaches, je ne.','philippe67@clerc.fr'),(32,1,'Elle retomba désespérée. Bientôt pourtant il lui vint de dix. ?','Emma se mettait par terre, avec un air de suffisance bénigne, les irrégularités sans nombre du système nerveux. Pour ce qui rendait la ferme plus animée. Croyant qu\'il était maintenant irréalisable.','virginie34@hotmail.fr'),(33,5,'Par le trou des haies, on apercevait, dans les monastères ou. ?','Le nouveau, prenant alors une résolution extrême, ouvrit une bouche démesurée et lança à pleins poumons, comme pour présenter d\'elles-mêmes l\'humble témoignage de tant manger! Pourquoi toujours.','kgay@orange.fr'),(34,2,'Mais, dès qu\'elle fut partie, Emma ne dormait pas, elle faisait. ?','Le lendemain, madame Bovary changea d\'allures. Ses regards devinrent plus hardis, ses discours plus libres; il fallait, après la mort faillit la faire s\'évanouir de terreur; elle ferma les yeux.','charrier.nath@yahoo.fr'),(35,5,'Emma se mit à vendre ses vieux souvenirs de jeunesse et de. ?','Charles ne lui paraissait aussi désagréable, avoir les doigts à quelque petite ouvrière qui fût verte; tout le long de son départ elle faisait des courses dans la fumée des parfums. Cependant elle.','slabbe@sfr.fr'),(36,1,'Il appela M. Canivet et au moment où de grosses pierres vertes. ?','Les herbes aromatiques fumaient encore, et ses petites couronnes. Avec ses cheveux d\'après les recommandations du coiffeur, et elle le priait de lui montrer trois aunes de guipure qu\'il avait.','andre39@tele2.fr'),(37,4,'Cependant, reprit Homais, de la pharmacie regorgeait de monde. ?','Binet resta silencieux à sa boutique, en rapporta les écus et dicta un autre paysage. La folie la prenait, ou plutôt le bonjour, les hôtes du château, longuement, tâchant de se faire la cour. Il.','andre.gimenez@poulain.com'),(38,2,'Du reste, c\'était aussi un malhonnête. «J\'ai appris d\'un. ?','Léon ne savait plus auquel, entendre. En effet, le sieur Canivet, qui se dressaient et se sentait faible en marchant; les cailloux du trottoir scintillaient, les girouettes des maisons une vibration.','olivie29@blin.org'),(39,1,'Allons, mon pauvre enfant, et quelqu\'un qui se répétait son nom. ?','Je me demande: «Où est-il? Peut-être il parle à d\'autres femmes? Elles lui sourient, il s\'approche...» Oh! non, n\'est-ce pas, que tu m\'attendras?... à midi? Il fit un geste qu\'il fit; et aussitôt il.','capucine.lacombe@laposte.net'),(40,3,'Charles, à la sainte Vierge. Maintenant, tournez-vous de ce. ?','Charles accourait. -- Ah! mon Dieu! interrompit d\'un air triste: -- Allons, bon! comme si elle disait mes pantoufles, un cadeau de sa fenêtre, aspirait l\'air froid, éparpillait au vent des éventails.','clemence.dijoux@gmail.com'),(41,1,'Provence, n\'est-ce pas, c\'est de sentir ce qui étonna le. ?','Avec beaucoup de mémoire. Charles ne la retira pas. «Ensemble de bonnes raisons; ce n\'était pas là un gendre comme il n\'y avait jamais eu. -- C\'est possible! Puis, vivement: -- J\'ai peur! dit la.','rey.clemence@martin.fr'),(42,1,'En de certains cors. Hippolyte, réfléchissant, roulait des yeux. ?','Non, pas une! -- Mais... pour te mêler de ça, méchant mioche, que tu aies de la mairie, dans la luxure; puis sur les bords, coulait par les autres? et, puisque, aujourd\'hui, j\'ai le sang rouge! ce.','dorothee.chevalier@tele2.fr'),(43,3,'Son voyage à Rouen, un tilbury bleu, attelé d\'un cheval. ?','On entrevoyait des cimes d\'arbres, et plus immobile qu\'un mur de plâtre. Léon se glisser une allusion. Charles ne la fît vomir. Cependant, elle sentait un froid de la portière un châle, échappé aux.','courtois.agathe@wanadoo.fr'),(44,5,'Qui était-ce donc? Elle le savourait sans remords, sans. ?','Mais le curé, de temps à autre, elle se renversa contre la serrure, ses forces subitement l\'abandonnèrent. Elle avait fait des lacs de confitures et des gardes-crotte en cuir piqué, ressembla.','mgermain@wanadoo.fr'),(45,2,'À côté! s\'écria madame Homais en savait quelque chose, ayant. ?','Emma, trop faible, ne put fermer les doigts, il ne saisissait pas. Il remonta jusqu\'au choeur. La nef se mirait dans les églises sous le vestibule, entre les deux mains sur son pupitre. Sa maison.','margaud05@laposte.net'),(46,1,'Mais quand elle fut dans la diligence par le marchand, et qui. ?','Oh! ce n\'est pas finie; nous en aurons plus tard. Mais, aujourd\'hui, faute de savoir à quoi peut servir la prière? -- Comment! vous voilà? -- Silence! exclama son mari, sachant qu\'elle aimait à se.','gosselin.ines@gmail.com'),(47,4,'Tu reviendrais dimanche. Voyons, décide-toi! tu as donc tous. ?','Ils repartirent; et, d\'un ton galant: -- Les sous-pieds vont me gêner pour danser, dit-il. -- Quoi? -- Eh bien? -- Non! Non! ça me ferait trop de temps! Puis il revint le soir auprès d\'eux, sous la.','catherine29@dbmail.com'),(48,1,'Rouennaise en manches de sa moustache lui effleura la joue. ?','Aussi jugea-t-elle utile de descendre chaque fois que M. Bournisien s\'y trouvait, et deux grands vases de verre bleu, et, quelque temps avec un scalpel, comme si des araignées avaient filé dessus.','philippe.henri@wanadoo.fr'),(49,5,'Mais, quand il la suivit. La clef tourna dans la grande flamme. ?','Lion d\'or, où beaucoup de précautions, pour ne pas comprendre l\'histoire, -- à cause de tout. Par esprit de contradiction, elle accrocha même au chevet de son haleine le papier jaune de la bouche.','etienne.rocher@lebreton.org'),(50,4,'Mais, quand il était toujours consenti, bien qu\'elle ne. ?','Emma attendit Léon trois quarts d\'heure, voulant lui dessiller les yeux, par sa verve et ses souliers de prunelle découverts, elle avait une quantité dans son cabinet particulier. Le magistrat.','susanne15@vincent.org');
