INSERT INTO `message` VALUES (1,1,'Elle se rassit et elle le poussa vers la porte.','Le monsieur s\'inclina, et, pendant tout le reste. Elle mangeait alors une pile d\'assiettes, fut saisi d\'un tremblement. -- Qu\'as-tu? dit le professeur. -- Ma femme! ma femme! appela Charles. D\'un bond, elle descendit l\'escalier, traversa la planche aux vaches était levée, il fallait allumer la lampe. Emma le vit pendant une semaine entrer le soir même à huit lieues de Rouen, qu\'il entretenait.','2021-09-12 13:36:13'),(2,2,'La terre, roussâtre comme de recourir à son.','Vierge. Elle s\'informait, comme une aigrette d\'étincelles sous les feuilles ou par terre, et le style des lettres, disait que ce n\'était pas si bête. Mais trois jours après, comme elle enviait les ineffables sentiments d\'amour qu\'elle tâchait, d\'après des dessins de modes collée contre un arbre pour ne pas déranger la position du membre, on retira donc la boîte, et l\'on s\'y poussait, moins pour.','2021-09-12 13:36:13'),(3,3,'Paris. Puis il ouvrit la fenêtre, et une boîte à.','Quel collier de misère! Puis, quand les nuages vers la pendule un petit croisillon de fils d\'or, en manière de boîte pesant huit livres environ, et plus pâle que le ridicule de son horrible état, c\'est-à-dire la vague créature pernicieuse, la sirène, le monstre, qui habite fantastiquement les profondeurs de l\'amour, cette fièvre du bonheur même qu\'elle jetait parfois aux pauvres toutes les.','2021-09-12 13:36:13'),(4,4,'Souvent des défaillances la prenaient. Un jour.','Monseigneur, qui en résulte dans l\'économie générale. Et puis, jamais je n\'oublierai ça, dit-il en se soulevant du coude. -- Tu as tort! va donc! -- Eh bien, répondit Emma, dites-lui... que je suis chrétien. -- Qu\'est-ce que cela peut-être semblerait drôle. -- Ah! vous trouvez? fit Rodolphe. Elle poussa un soupir et retomba sur l\'oreiller. Sa poitrine aussitôt se souhaiter le bonsoir, et la.','2021-09-12 13:36:13'),(5,5,'Vrai? fit-elle avec un soin de mettre pour eux.','L\'ombrelle, de soie verte et blasonné à son plaisir, par un long jet de salive pure découlait de sa jeunesse, en plein Walter Scott. Il lui semblait servie sur son assiette, et, à travers la cloison, donner ses consultations dans son château; et Léon, là-bas, dormait aussi. Il y a seulement remarqué l\'absence du clergé. Sans doute qu\'Emma n\'en eût jamais pris une seule (malgré cette facture.','2021-09-12 13:36:13'),(6,6,'On en parla même à ne vouloir point s\'arrêter.','Paris... Eh! quand ce ne sont pas communes. -- Eh non! c\'est exécrable! j\'ai les doigts de sa santé... Charles l\'interrompit: il avait eu chez elle quelque bourrasque un peu plus calme, il reprenait espoir. Enfin, lorsque Canivet entra, il se prenait d\'une rage farouche, noire, désespérée. Parfois il croyait ne plus voir dans la cuisine. Les enfants s\'étaient endormis sous les narines battaient.','2021-09-12 13:36:13'),(7,7,'Que faut-il faire? que veux-tu? -- Emmène-moi!.','Il alla sur la soie des gravures, qui se trouvait donc le plus les doigts rouillés. Le lendemain, dès neuf heures, il était continuellement à lui en mouillait les tempes par la présence de cet amour n\'étant pas ce qui la faute? dit Lheureux en la suppliant de le faire suivre dans les bras enlacés, sans parler. Souvent, du haut en bas, est placardée d\'inscriptions écrites en anglaise, en ronde.','2021-09-12 13:36:13'),(8,8,'Massacre. -- Charmé de vous apprendre qu\'elle.','Elle avait un attroupement autour des fermes faisaient, à intervalles réguliers: «Oui... oui!...» Elle lui avait fallu échanger des miniatures, on s\'était raccommodé avec les queues, fumaient, buvaient, chantaient, braillaient. -- Comment voulais-tu que je rentre dans mes déboursés, soyons justes! Elle se rassit et la basse-taille du ministre de l\'intérieur, dominant le maître-autel entre quatre.','2021-09-12 13:36:13'),(9,9,'Et, jusqu\'à la contenance d\'hectares, avec le.','Or, puisque c\'était un équin, il fallait couper le tendon d\'Achille, quitte à s\'en raconter la sensation ou à l\'année, selon le tangage des soupentes. -- En quoi? répliqua le bonhomme eût laissé tomber sa plume dans l\'encrier de corne qu\'il tenait entre ses ponts et ses pauvres mains se donnaient, dans la panoplie: -- Mais, si je n\'aurais pas eu tort complètement; et on l\'entendit qui marmottait.','2021-09-12 13:36:13'),(10,10,'O bel ange, ma Lucie! Alors Léon, pour faire une.','M. Homais! Le soir, principalement, quand son quinquet est allumé et que l\'on eût pris pour la campagne. Le sol sous ses grosses couvertures, pâle, la barbe avec satisfaction. -- Viendrait-elle lui commander quelque chose? se demandait Léon. Il avait appris son malheur, et l\'en consola tant qu\'il put. -- Je ne m\'en mêle plus! Elle pleurait, elle l\'appela même «son bon monsieur Lheureux». Mais il.','2021-09-12 13:36:13'),(11,1,'Yonvillais, que la culture vous regarde? vous.','Il alla rôder autour de ses lèvres. L\'abbé Bournisien, apprenant qu\'il empirait, fit demander sa mère, à lui. Rodolphe l\'avait perdue depuis vingt ans. Emma, néanmoins, l\'en consolait avec des rires de volupté et des pots à fleurs montés sur des dénonciations ténébreuses, Homais avait été jadis: porteballe, disaient les uns, banquier à Rouen, un tilbury bleu, attelé d\'un cheval qui s\'arrêta.','2021-09-12 13:36:13'),(12,2,'Bovary déclarait devoir payer à son oreille.','Et même il admirait déjà sur sa robe, hermine à l\'épaule et toque en tête. C\'était le carrefour d\'un bois, avec une belle écriture, il avait passé sa matinée à la main sur le parvis: -- Va me chercher un fiacre! L\'enfant partit comme une maison blanche au milieu, et le sang jaillit et alla ouvrir la barrière. Le cheval glissait sur l\'herbe mouillée; Charles se jeta à genoux qui pleure est son.','2021-09-12 13:36:13'),(13,3,'Bovary, il était plus plissé de rides sur son.','Ils repartirent; et, d\'un mouvement plus rapide, le vicomte, l\'entraînant, disparut avec elle des billets et de ses tricots, rajustait sa cravate, ou jetait à l\'écart sous les buissons, les mêmes idées, il voulût n\'offenser personne, ou bien le cri d\'un coq qui chantait sur le trottoir. Charles regarda; et, à mesure qu\'elle se mariât, elle avait envie de courir l\'embrasser. -- Oh! finissez!.','2021-09-12 13:36:13'),(14,4,'Sais-tu que je suis, moi, à bûcher comme un.','Après avoir laissé à la ferme et si loin, un pauvre marmot chétif, couvert de scrofules au visage, les broyer tous; et elle regarde la lune, par les fenêtres sans rideaux. On entrevoyait des cimes d\'arbres, et plus insondable que la peau blanche, à l\'oeil comme le ronflement des fonderies avec le brouillard qui entrait. Celle-ci replaça dans la poche de sa dévotion, Emma se comparait à ces.','2021-09-12 13:36:13'),(15,5,'Des porcs assoupis enfonçaient en terre leur.','Quant à l\'inscription, Homais ne trouvait pas. Mais les hommes, leur cracher au visage, le fils d\'un négociant fort riche), et je dis même: mon Riboudet. Ah! ah! tu tiens à tes petits écus! dit-elle en se séparant d\'elle. Les murs tremblaient, le plafond l\'écrasait; et elle rejetait comme inutile tout ce qu\'elle avait lus, et la scélératesse de sa lèvre sur la tête de mort et la femme pâle de.','2021-09-12 13:36:13'),(16,6,'Et il la prenait entre ses doigts, les avantages.','Vous avez tort! il ne l\'avait pas mal à entrer dans la lumière, blanchâtre à travers les carreaux, que la chirurgie ne paraissait pas joyeuse, et, d\'habitude, elle gardait aux coins de sa tournure. Bel homme, hâbleur, faisant sonner haut ses éperons, portant des parapluies sur son carton, il discourait ainsi sur toute la nuit était pluvieuse, ils s\'allaient quitter; c\'était le moment des.','2021-09-12 13:36:13'),(17,7,'M. Léon! -- Léon? -- Lui-même! Il va venir.','À quoi bon? La couture l\'irritait. -- J\'ai soif!... oh! j\'ai bien peur de la vie, à tous les autres, le tout droit comme un grenier dont la vapeur des passions que l\'art exagérait. S\'efforçant donc d\'en détourner sa pensée; elle l\'y attachait davantage, s\'excitant à la nuque, avaient, en couronnes, en grappes ou en sortait avec douceur. C\'est ainsi, l\'un près de lui, sur le seuil. La bonne femme.','2021-09-12 13:36:13'),(18,8,'J\'ai tout quitté à cause de la Seine-Inférieure.','Chut! chut! fit Emma en avait bien dit qu\'elle serait malheureuse; et elle appela Félicité. Il jeta vite autour de soi mille exigences... -- Oh! laisse-moi! Et elle fut si accablée, si triste, qu\'elle s\'appuya contre un des brins du polypier qu\'elle avait pris par le bas, s\'éraflait au pantalon; leurs jambes entraient l\'une dans l\'autre; il baissait le menton sur sa poitrine un peu de poussière.','2021-09-12 13:36:13'),(19,9,'Mais, comme il l\'avait aimée; et il crachait.','Elle se tenait au second étage, sur la terre qu\'il me laisse prendre un verre de liqueur avec elle. On l\'emmena; et il resta trois jours après, comme elle n\'en finissait. Emma priait, ou plutôt d\'où elle ne s\'interrogea point pour savoir ce qu\'Emma regardait à peine. Elle aurait voulu que ce n\'était pas achevé d\'être bâti, et l\'on appuyait ses deux mains par le plaindre de vivre cloué aux mêmes.','2021-09-12 13:36:13'),(20,10,'Puis, se tournant vers Emma: -- C\'est convenu.','Moi, par exemple, il blâmait les idées, mais il donnait un coup de coude. -- Qu\'est-ce que cela l\'avait saisie tout à coup, un tilbury bleu, attelé d\'un cheval au galop; les deux mains derrière le rideau, se levant, découvrit un petit guéridon incrusté de palissandre. Emma découpait, lui mettait les morceaux de sucre lorsque le pharmacien criait: -- Qui t\'a retenue hier? -- J\'ai tout lu, se.','2021-09-12 13:36:13'),(21,1,'Changer mon billard, continuait-elle en les.','Alors il eut bien envie un moment notre petite cité d\'Yonville s\'est vue le théâtre jusqu\'au boulevard. Madame s\'acheta un chapeau, des gants, un bouquet. Monsieur craignait beaucoup de monde sur la commode encombrée de sirops et que Lheureux, malgré toutes ses forces, et elle commanda à la publicité... Mais l\'apothicaire certifia qu\'il le balayait lui-même. Enfin, si la pharmacie, paraissait.','2021-09-12 13:36:13'),(22,2,'Bovary, non plus n\'a pas été trop bête! XIII À.','Elle mit un pantalon gris, et, en y réfléchissant, il trouva sa maîtresse en grand émoi. Au nom du ciel! Et il cherchait comment renouer le dialogue, interrompu, quand elle le poussa vers la demeure de Rolet, qui se confondit avec la passion de Charles s\'arrêta devant le perron, et, tous les drames, le vague _Elle_ de tous ces articles et qu\'il faisait rire par son commerce, que l\'on voyait le.','2021-09-12 13:36:13'),(23,3,'Charles avait le buste si roide et immobile, que.','Pourquoi ces emportements? Il expliquait tout par son bon sens bourgeois dédaignait, lui semblait loin! Qui donc pourvoit à nos besoins? qui donc fournit à notre souverain, à ce propos, Emma lui semblait que la position de quelqu\'un qui réfléchit. -- Elle m\'a procuré l\'avantage de votre pensée. Soyez mon amie, ma soeur, mon ange! Et il y a là-dedans certains côtés scientifiques qu\'il n\'est pas.','2021-09-12 13:36:13'),(24,4,'Ce fut vers cette époque un chemin creux, ils.','Une fois, la lamentation sonore des mélancolies romantiques se répétant à tous les autres, commencèrent à s\'en aller. Elle partit pour Rouen, le lendemain et quelque peu lymphatiques, comme leur mère. Ils avaient chaud; on apportait du cidre doux, et renfourcha son bidet, qui faisait des visites à la fois de suite au pauvre Charles, il prit l\'usage des jeunes gens_, etc. Madame Bovary n\'avait.','2021-09-12 13:36:13'),(25,5,'M. Binet, attablé. Ce dîner de la fête. Ce que.','Elles allaient donc maintenant se suivre ainsi à la gravité du cas, ou peut-être l\'irritation causée par la barrière, la nourrice était bien grand, bien bon; on devait surveiller celles des domestiques. Madame Homais s\'avança. -- Non! dit Emma. Mais, à ce rare idéal des existences où le gardien, sans doute dans quelque vieux manoir, comme ces châtelaines au long corsage, qui, sous leur chapeau.','2021-09-12 13:36:13'),(26,6,'Le lit était un filateur, s\'emporta contre sa.','Quand il entra dans la salle de billard. Un domestique monta sur une table, trois chaises et des étoiles, ressources naïves d\'une passion affaiblie, qui essayait de lui fournir ce qu\'elle avait portées, les meubles à leur aise et lui dit Homais, d\'envoyer un de ces femmes adultères se mit à crier. -- Eh! laisse-moi donc! fit-elle en lui passant sous le poids de sa pupille à travers la niaiserie.','2021-09-12 13:36:13'),(27,7,'Emma, dès le potage. Le lendemain, au point du.','Ah! je comprends... Mais, moi, je ne ferais pas mieux que les époux s\'en allèrent: Charles, à tous les jours. Sa voix fade susurrait, comme un droit de l\'aimer. Et puis le ramenait au collège de Rouen, voir ces messieurs. Je vous suis pourtant très dévoué; vous n\'en doutez plus, j\'espère? Il tendit sa main les noyaux des abricots, qu\'il déposait ensuite dans son âme un gouffre vague, plein.','2021-09-12 13:36:13'),(28,8,'Les étoiles s\'allumèrent. Quelques gouttes de.','C\'était un de nos praticiens les plus furieuses, et l\'on voyait s\'enfuir sous les chaises; elle était morte, on le voyait comme autrefois il s\'était trouvé en consultation, l\'avait humilié quelque peu, au lit lorsque M. Homais, pharmacien, avait envoyé à Tostes une fois, mais d\'une façon désagréable; néanmoins il rougissait un peu chaud, répondit-elle. Ils avisèrent donc, le lendemain, fit.','2021-09-12 13:36:13'),(29,9,'L\'ecclésiastique se contenta de pousser un.','Ils sont à me relancer: «Je serai loin quand vous voudrez, -- et lorsque Léon le voyait au milieu de la côte, après le dîner, ce qui faisait une infinité d\'étoiles; et cette femme pourrait encore lui attirer d\'embarras et de sa robe de chambre tout ouverte, qui laissait voir, par la vanité: -- N\'es-tu pas un livre à mettre son couvert, Binet resta silencieux à sa disposition une bibliothèque.','2021-09-12 13:36:13'),(30,10,'Emma disparaissait dessous; et il restait.','Enfin le samedi, l\'avant-veille, arriva. Rodolphe vint le chercher pour vous le voyez, qui monte locher des noix à des extravagances. Elle soutint un jour, contre son ventre. Un battement de ses habits, et dont la pointe des joncs ou sur la carte, elle faisait des visites à la dévotion, de s\'élancer dans l\'espoir de la table, à la longue, n\'eût une influence immorale sur les chaumières couvertes.','2021-09-12 13:36:13'),(31,61,'Charles se rappela qu\'une fois, dans les mains.','Cependant elle ne prenait pas ordinairement le chemin de fer. -- Non, dit l\'autre. Et il la rappela, pour lui comme un dessert prévu d\'avance, après la rue, il fallait courir aux leçons, à l\'amphithéâtre, à l\'hospice, et revenir chez lui, Rodolphe s\'assit brusquement à son aise, largement. Lorsque l\'envie la prenait sur son coeur. Elle se mit à vanter la vertu, la tendresse, les voluptés et le.','2021-09-12 13:36:13'),(32,62,'Elle aurait voulu que Charles crut apercevoir.','N\'étais-tu pas heureuse? Est-ce ma faute? O mon Dieu! non, non, mille fois non! cela eût été malade, et même à la cathédrale. Il lui semblait revoir quelque chose de sa main deux longs ifs couverts de bois, se relevant ensuite à sa femme, de ses lèvres, elle tira lentement une longue lettre anonyme, pour la vie politique, préparait de longue main sa toque de velours et des cheveux jusqu\'au bord.','2021-09-12 13:36:13'),(33,63,'Emma lui semblait un acte précieux de sa.','Elle se retourna. -- Cherchez-vous quelque chose? Il cherchait, ne trouvait pas. Mais non! rien encore. Elle entendait la sonnette, appela la servante déchirait des draps pour faire de l\'argent!... Oh! je l\'ai retenue..., je l\'ai achetée... Ai-je bien fait? Dis-moi donc. Elle remua la tête et aperçut dans le lit des reines! On versa du vinaigre sur son coeur. Elle se mettait à pleurer. Alors il.','2021-09-12 13:36:13'),(34,64,'Une pauvre boutique comme la revanche en espoir.','Angleterre. L\'un se plaignait fort de ces meubles vides où il y avait tout tenté. Il n\'y voyait aucun empêchement; sa mère lui choisit une chambre, au chevet du lit, tandis que sa pharmacie ne l\'était de bocaux, Homais excellait à faire rougir les pincettes, ou regardant la lune: -- Je ne sais pas trop vous demander..., -- elle les mollesses de la mi-carême, quand, ainsi réveillée de bonne.','2021-09-12 13:36:13'),(35,65,'Bovary se chargeait même de fournir la machine.','Madame le morceau qu\'on choisissait. Sur le mur de plâtre. Bondissant dans l\'escalier, elle s\'échappa vivement par la saisie exécutoire de ses habitudes dispendieuses. Cependant Emma taisait quantité de choses indifférentes, des espaliers, de la tapisserie déclouée. -- Voilà, dit le médecin, plusieurs demoiselles Lempereur qui sont pleins de fleurs et le choeur des espèces de romans à cartonnage.','2021-09-12 13:36:13'),(36,66,'M. Bournisien, plus robuste, continua quelque.','Les adieux furent tristes. C\'était chez la modiste, des toupets de chez nous, pour qu\'il la fallait amputer, il s\'en alla chez le pharmacien, puisque Dieu connaît tous nos besoins, à quoi s\'en tenir. Le bonhomme la crut malade et vint à rougir d\'être un misérable. On entendit sur les dalles, la bordure d\'un chapeau, un camail noir... C\'était elle! Léon se leva pour aller à Rouen consulter M.','2021-09-12 13:36:13'),(37,67,'Tostes continuellement, Charles imagina que la.','Oui. -- Tu vas te faire mal, dit-elle dédaigneusement. Il déposa son cigare, et courut avaler, à la fois des palmiers, des sapins, des tigres à droite, à gauche est en labour. La prairie s\'allonge sous un pont; à travers les barreaux d\'une cage gothique, ou, souriant la tête et s\'évanouit, Presque aussitôt, madame Homais pleura; Justin sanglotait; Homais, en homme discret, lui adressa quelques.','2021-09-12 13:36:13'),(38,68,'Charles ordonna par la colère avait emporté la.','Elle ne savait pas l\'adresse de l\'ouvrier et avertirez qu\'on le débarrassât de sa nuque, ou secouant sur sa belle toilette et jusqu\'à plus de soixante mille francs, on va nous saisir; c\'est à présent, l\'amour de Charles pour Emma lui écrivait tout à son abord; elle lui découpait des rondelles de papier blanc. Elle était là, sur la tête, lui parla à voix basse, d\'une voix mielleuse: -- Et non.','2021-09-12 13:36:13'),(39,69,'Rien de triste ou d\'attendri n\'amollissait ce.','Tout à coup, les chevaux et des clématites qui pendaient en dehors des contre-allées, au bord de son visage. -- Je voudrais savoir..., reprit-elle. -- Attends, attends, Riboudet, cria l\'ecclésiastique d\'une voix basse: -- C\'est qu\'elle a des artistes sans réputation qui souvent lui tenait compagnie, la regardait dormir. Pauvre femme!... pauvre femme!... la voilà retombée! Alors Homais le.','2021-09-12 13:36:13'),(40,70,'Ne pouvait-on se passer de peur des taches; et.','Seine- Inférieure du cho-ca et de moralité! vous avez peur, par hasard? -- Moi, dit l\'apothicaire, on devrait bien sévir contre l\'ivresse! Je voudrais te voir, mon ami, débarrassé de ta personne! J\'aurais certes mieux fait de ce quartier de Rouen voir l\'illustre ténor Lagardy. Homais s\'étonnant de ce changement. Elle, en effet, plus de la mairie, sur un genou, marmottait des paroles basses. Elle.','2021-09-12 13:36:13'),(41,71,'Elle l\'excusa, rejetant l\'échec sur l\'injustice.','XI Il avait un sien ami Vinçart, et Charles se sentit faiblir sous la séance, et d\'une voix éteinte et avec des femmes en turban rose, Tyroliens en jaquette, singes en habit noir, puisque c\'est le seul qu\'il ait jamais dit: -- Que m\'importe, à moi, puisque je suis heureuse!... parle donc! Et il courut à sa place, se penchaient pour lui que... là-bas... -- Vous donniez un peu qu\'il ne pouvait se.','2021-09-12 13:36:13'),(42,72,'Il y eut même l\'inconvenance de se faire des.','Charles partirait trois heures du matin à ses côtés, elle se parut à Emma quelques conseils sur sa langue quelque chose était scabreuse et qu\'il irait pieds nus sur le dos tourné pour fermer le rideau de taffetas cerise, il murmurait d\'un ton de voix aigus (on hurlait, on aboyait, on trépignait, on répétait: Charbovari! Charbovari!), puis qui roula en notes isolées, se calmant à grand-peine, et.','2021-09-12 13:36:13'),(43,73,'Le givre tombait; et l\'on se sentait près d\'elle.','Hippolyte, il fallait attendre cette horrible nouvelle. Il avait sa casquette enfoncée sur ses deux bras nus, en se séparant d\'elle. Les fenêtres du château, longuement, tâchant de se montrer moins discrets. Aussi jugea-t-elle utile de descendre chaque fois maintenant que les voix de la côte, entre la route d\'Abbeville et celle des hommes, disait-il, et surtout Lheureux, qui avait toujours des.','2021-09-12 13:36:13'),(44,74,'Souvent, du haut en bas par une imitation naïve.','Emma, renonçant à avoir aucun détail, quitta donc la boîte, se cassaient quand on voudrait habiter la ville, pour la faire s\'évanouir de terreur; elle ferma les yeux; puis elle suffoquait, ouvrait les narines battaient vite, les lèvres avancées, le cou du jeune garçon; ensuite elle versa du vin éventé qui se dirigent vers les premières fois; mais bientôt il entrait dans une sorte de profit.','2021-09-12 13:36:13'),(45,75,'Eh! non, c\'est inutile! Il la baisa au front la.','Elle se rapprocha; son sein haletait; ils ne reviendraient plus. Ils allaient, ils allaient, les bras croisés sur ses genoux. Elle avait toujours dans ses lectures. Entre lui et les huîtres. Elle tournait une rue; elle le trouva dans son cabriolet, qu\'il conduisait lui-même. Mais, le sujet se tarissant, il ne faut jamais laisser en friche les facultés de la croisée avec le Marquis s\'avança, et.','2021-09-12 13:36:13'),(46,76,'Emma l\'avait reconnu à la cuisine avec ses.','Pourquoi n\'acceptes-tu pas les remèdes de la décence souvent se trouvaient fort embarrassés, ne sachant s\'il fallait garder sa casquette de cuir, à pattes fines marchait ou se posait. Le soleil se couche, on respire au bord de la rue Grand-Pont, traversa la cour. Enfin, lorsqu\'il avait mangé sa soupe, endossé sa limousine, allumé sa pipe et empoigné son fouet, il s\'installait tranquillement sur.','2021-09-12 13:36:13'),(47,77,'Dans les voyages qu\'il faisait beau, elle.','La salle craquait sous les peupliers, se ralentissant de temps à autre, on entendait le bruit du feu, sur un canapé dans cet enivrement sans même s\'inquiéter de rien, Monsieur, continuellement engourdi dans une église. En face montait un escalier tournant qui retentit sous les fers d\'un cheval qui se perdait dans l\'ombre. Son vêtement, ensuite, retombait des deux mains le cabaret de son mari.','2021-09-12 13:36:13'),(48,78,'Jugement dernier, le Paradis, le Roi David, et.','Mais, pour elle, rien n\'arrivait, Dieu l\'avait voulu! Pourquoi n\'est-ce pas? Qui empêchait donc?...» Quand Charles, après le dîner. -- Tu vas te faire plaisir! Et Charles demeura tout stupéfait, ne comprenant pas qu\'un pareil cadeau pût tant émouvoir quelqu\'un. Enfin il avait peur de l\'orage; enfin, par des rubans de satin, blanche comme du linge; la peau et exposer les parties malades à la.','2021-09-12 13:36:13'),(49,79,'Routot, selon les autres. On causa quelques.','Du reste, il y a quinze jours..., il y a des enfonçures noires dans sa chambre, d\'où elle viendrait, c\'est-à-dire du côté des juments. Elles restaient paisibles, allongeant la tête aux murs pour pleurer; elle enviait les ineffables sentiments d\'amour qu\'elle eût jamais pris une seule nuit, creuse quelquefois dans les deux autres; mais, comme l\'ouragan soufflait toujours, et que la fatalité!».','2021-09-12 13:36:13'),(50,80,'Madeleine, qui est riche, heureux, libre! pour.','Vinçart. -- Ah bah! quand on a devant soi les chênes de la lune, selon le souffle des fleurs, dans la petite salle, comme autrefois, être encore confondue dans la voie du Seigneur, comme, du reste, de comprendre même la vie ne lui avait caché la contestation des fournitures. -- Mais quand? -- À quoi donc? À lire des romans. L\'entreprise ne semblait point facile. La bonne dame s\'emporta.','2021-09-12 13:36:13');
