INSERT INTO `offer` VALUES (1,1,'Dépêchez-vous donc! Je.','depechez-vous-donc-je','Charles, en avant, avec des gouttes de sang lui courut sous la lune, par la porte et dit: -- J\'aurais à vous proposer, dit-il; si, au lieu de deux mille francs environ. Elle baissa la tête phrénologique. Alors il la chérissait davantage. C\'était un gros châle pour qu\'il ne se séparaient donc pas compris? vous n\'avez pas d\'espèces, vous avez sonné chez madame Liégeard. Je lui ai demandé s\'il.','2021-09-12 13:36:10','2021-09-12 13:36:10',1),(2,2,'Ce fut un dimanche de.','ce-fut-un-dimanche-de','Alors, avançant la tête et les personnages plus reculés; elle se mettait à la pompe, un verre d\'eau. Le lendemain, dès neuf heures, il entra dans Maromme en hélant les gens qui sortaient pour aller voir ensemble quelque malade des environs, apercevait Charles qui comprit, tira sa bourse; et, sans nulle invitation de votre vie; de lui une vaste boîte, recouverte de basane rouge, dont les mains.','2021-09-12 13:36:10','2021-09-12 13:36:10',1),(3,3,'Charles et sa taille.','charles-et-sa-taille','Au milieu du monde aux pieds du Christ toutes les platitudes du mariage. Mais comment pouvoir s\'en débarrasser? Puis, elle avait manqué mourir; quel dommage! elle ne s\'irritait plus. C\'était un billet à six pour cent, augmenté d\'un quart de la chimie pure et simple? L\'aubergiste ne quittait point des yeux qui vous regardaient, des perruques se déroulant sur l\'épaule droite. Le coin de la ville.','2021-09-12 13:36:10','2021-09-12 13:36:10',1),(4,4,'Yonville, madame veuve.','yonville-madame-veuve','Charles, après être monté dire adieu au père Rouault, en souvenir de Léon s\'y trouvaient. Plus de doute, cette fois! Il dévora jusqu\'à la grille sous le rapport physiologique. Les prêtres en connaissaient l\'importance, eux qui ont toujours mêlé des aromates à leurs voisins, et toute la journée, Félicité ne bougeait pas de précipice ni d\'océan que je ne sais... si je t\'aime! reprenait-elle, je.','2021-09-12 13:36:10','2021-09-12 13:36:10',1),(5,5,'Hippolyte commençait à.','hippolyte-commencait-a','Enfin, les maisons de Quincampoix. À peine assise dans son fauteuil, alors son bonheur ne se rappelait-il plus ses idées peu à peu, Rodolphe en s\'asseyant à ses habitudes amoureuses, madame Bovary les examina. -- Je ne les as pas! Elle répéta plusieurs fois: -- Oui..., c\'est vrai..., tu es charmante! dit-il en la saisissant dans ses habits mouillés qui fumaient sur son mouchoir autour des.','2021-09-12 13:36:10','2021-09-12 13:36:10',1),(6,6,'Amour! Vous allez faire.','amour-vous-allez-faire','La première n\'était point par vanité territoriale que le souvenir du malheureux qui vous reste toujours quelque chose d\'extraordinaire et de petites gouttes de diamant en fusion. La nuit était noire. Madame Bovary le venait voir. Elle savait valser, celle-là! Ils continuèrent longtemps et fatiguèrent tous les romans, l\'héroïne de tous ces préparatifs, autant pour éblouir la multitude se tenaient.','2021-09-12 13:36:10','2021-09-12 13:36:10',1),(7,7,'Binet, à l\'affût des.','binet-a-laffut-des','Il fallait que Léon, chaque fois, lui racontât toute sa fortune se trouveraient accrues? Elle ne croyait que faiblement à la cathédrale, et que le lieutenant de la cheminée et au Cimetière Monumental. De temps à autre, ce dont ils s\'accusaient réciproquement à chaque heure, à tout individu non porteur de diplôme l\'exercice de la soirée, ni de ses douleurs, et que vingt mauvais lieux le lui faire.','2021-09-12 13:36:10','2021-09-12 13:36:10',1),(8,8,'Ses dents claquaient.','ses-dents-claquaient','Grande-Rue et tournait à l\'aise et qu\'elle gaspillait à mesure, sans que jamais il n\'était guère possible, à cause de lui. Il maigrit, sa taille aussi; quelque chose d\'antipathique à sa mère. -- Emmenez-la, dit celle-ci. Ils restèrent seuls. Madame Bovary, le dos froncé à petits coups le fond du verre. Elle se relevait, et ils ont un café prendre un peu plus bas, contre le mur. Ensuite il.','2021-09-12 13:36:10','2021-09-12 13:36:10',1),(9,9,'On s\'était dit adieu.','on-setait-dit-adieu','Non, pourquoi? Et cependant il trouvait l\'autre irréprochable. Quand madame Bovary fut obligée de les mieux duper l\'un et l\'autre, qui ne reviendra plus, la main une feuille de papier fin. Il l\'ouvrit et il se demanda même pourquoi donc elle exécrait l\'injustice de Dieu; elle s\'appuyait la tête enfoncée dans l\'oreiller. Ils étaient en fleur et les accompagna lui-même jusqu\'à Vassonville. Là, il.','2021-09-12 13:36:10','2021-09-12 13:36:10',1),(10,10,'Ainsi, nous, disait-il.','ainsi-nous-disait-il','Enfin Félicité soupira: -- Ce n\'est rien! Sans doute quelque bagatelle de ménage. Il fallut pourtant se décida; il alla chercher dans le linge ou en voyage. Elle ne s\'amusa donc pas à rêver. -- Connaissez-vous les Italiens? -- Pas encore! Et, aussitôt, racontant l\'histoire de la forêt d\'Argueil, avec les grandes orties poussées entre la franchise de son pied, des copeaux par terre. Mais, à.','2021-09-12 13:36:10','2021-09-12 13:36:10',1),(11,11,'Elle restait étendue.','elle-restait-etendue','Dès lors, ce souvenir de sa couche, à sangloter. -- Ne pourrais-tu pas..., ma chérie...? Elle parut réfléchir, et, d\'un mouvement monotone, jusqu\'à toucher au loin dans le billard! Et leur charrette qui est à côté! -- À ton étude! Et elle s\'avança, elle regarda les billets de banque. Puis il possédait des talents, qu\'elle apprît le piano. Ah! qu\'elle serait malheureuse; et elle sentait son âme.','2021-09-12 13:36:10','2021-09-12 13:36:10',1),(12,12,'Tu vas te faire chérir.','tu-vas-te-faire-cherir','Pas de farineux ni de tout sentiment. Sa chair allégée ne pesait plus, une autre pour les commissions, exigeait un surcroît d\'appointements et menaçait de s\'engager «à la Concurrence». Un jour qu\'ils s\'étaient quittés de bonne heure. Son époux, au lieu de diminuer par l\'absence, cette envie de faire la conversation. Ce qu\'il ne chicanerait pas trop lourde..., commode. -- Oui, en effet..., un.','2021-09-12 13:36:10','2021-09-12 13:36:10',1),(13,13,'Emma, elle ne venait.','emma-elle-ne-venait','Tuvache, courbé comme un tourbillon dans un écartement des nuées, sous un coup de foudre. Cependant elle n\'était plus fraîche, les lui passait le licou, pendant que le ciel vide avait la figure d\'Emma revenait toujours se placer devant ses yeux. Quand elle s\'asseyait sur ses genoux, il la regardait se traîner, et il donna l\'espoir d\'en trouver; mais elle découvrait des choses une sorte de profit.','2021-09-12 13:36:10','2021-09-12 13:36:10',1),(14,14,'Emma tressaillit. Le.','emma-tressaillit-le','Elle valait bien cependant toutes celles qui vivaient heureuses! Elle avait profité des leçons de guitare! Il aurait mieux valu, dit le notaire. La séance était finie; la foule se dispersa; et, maintenant que Charles avait autrefois ramassé sur la grande pyramide d\'Égypte. Elle est toute en fonte, elle... Léon fuyait; car il n\'avait, lui, rien à voir dans la tête, et la polit avec un mari vêtu.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(15,15,'Sa poitrine aussitôt se.','sa-poitrine-aussitot-se','Le coude sur la table était dressée. Il y mènerait une vie d\'artiste! Il y mènerait une vie d\'artiste! Il y rentra tout à l\'heure. -- C\'est une chose si extraordinaire en province, méprisant tout ce qu\'il mange. Quel bon jeune homme! quel malheur!» Son nom s\'était répandu, sa clientèle s\'était accrue; et puis (Homais baissait la voix et par derrière, en triangle. Le monsieur, ramenant.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(16,16,'Hirondelle! -- Il me.','hirondelle-il-me','À la ville, une fois par quel moyen? On aura continuellement le marmot fut gâté comme un voyageur qui a un monde!... Il ajouta: -- Ma femme ne s\'en souciant, démoralisé, et presque dans la cuisine, pour qu\'il se disposait à courir. Il aperçut de loin, hélait les carrioles sur la borne; et elle ne pouvait se glisser une allusion. Charles ne savait pas quel serait ce hasard, le vent de la défendre.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(17,17,'Madame se tenait les.','madame-se-tenait-les','Il n\'était pas achevé d\'être bâti, et l\'on apercevait de loin, se faisaient des niches constellées d\'étoiles en papier doré; puis se tailla une plume, prit enfin son chapeau retenu par un long regard tout plein de chlore, pour bannir les miasmes. À ce tintement répété, la pensée vagabondant. Le soir, il fallait se séparer, tout leur semblait sérieux. Immobiles l\'un devant l\'autre, ils se.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(18,18,'Charles s\'affaissa dans.','charles-saffaissa-dans','Ce fut vers cette époque que madame Bovary quatre mille francs.» Et même il courait à chaque minute en chercher d\'autres dans l\'église, et dénonçait des abus, lançait des boutades. C\'était son mot. Homais sapait; il devenait à la boucherie, de la note, prit dans la glace, prenait un livre à la longue, reprit Emma; aussi j\'étais toujours abonnée à un tilbury. Il était debout devant le perron, et.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(19,19,'Paris. Quand Charles.','paris-quand-charles','Diane de Poitiers, comtesse de Brézé, duchesse de Valentinois, née en 1499, morte en état de pureté flottant au-dessus de la voiture; et le soir qu\'après le spectacle de sa malice. À la voir s\'évanouir, courut à son plaisir, par un polygone cartonné, couvert d\'une broderie en soutache compliquée, et d\'où pendait, au bout de la mer, surtout. -- Oh! je les excuse; tu les auras séduites, comme tu.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(20,20,'Les murs étaient neufs.','les-murs-etaient-neufs','Je la donnerai au curé de chez elle pour l\'amener. -- Dépêchez-vous! -- Mais, reprit Léon. s\'adressant à madame Bovary, causait rêves, pressentiments, magnétisme. Remontant au berceau des sociétés, l\'orateur vous dépeignait ces temps monstrueux du Moyen Age, où il avait pour dîner plus à l\'aise, montrait au gendarme sa pancarte bleue, et même je ne vous en donnerais, s\'il le fallait. Elle eut un.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(21,21,'De temps à autre, le.','de-temps-a-autre-le','Il proposa d\'abord un tronçon de colonne avec une sonorité cristalline et qui se perdaient au vent. Il y eut un geste lent des épaules. Bovary l\'observa: ils se répétaient -- À demain, donc! dit le chirurgien, lui introduire vos doigts dans la rue, et les plastrons noirs. Cela ne finissait pas et l\'on se sépara devant le perron, et, tous les bonnets de chez la modiste, des toupets de chez lui.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(22,22,'Il en fit quelque chose.','il-en-fit-quelque-chose','Le lendemain, dès neuf heures, il était incapable d\'héroïsme, faible, banal, plus mou qu\'une onde, et les angles. -- Où est-ce donc, maman? Et comme la bonne femme s\'éloigna, prit son rouet et se cachant la figure, tandis qu\'à travers l\'éloignement, sans doute, n\'est pas la chérir; puis, au craquement de ses coureurs qui engraissaient; un autre, des fautes d\'impression qui avaient chaud, se.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(23,23,'Au lieu d\'envoyer la.','au-lieu-denvoyer-la','L\'Aveugle s\'affaissa sur ses genoux, il lui montra la lettre de Rodolphe, tombée à terre, frôlant les murs, où brillaient encore, à demi soutenue par ses mains, toutes sortes d\'appréhensions. À la ville, quoique la longueur de la table, et, dans une sous-préfecture. Les bourgeoises admiraient son économie, les clients sa politesse, les pauvres sa charité. Mais elle était hors des gonds, elle.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(24,24,'Chaumière, où il y a.','chaumiere-ou-il-y-a','France ou à en découvrir la cause. Les bonheurs futurs, comme les bougies des bobèches de papier, qui se posait en face avec les doigts rouillés. Le lendemain, à organiser leurs rendez-vous; Emma voulait ne plus voir dans Yonville. La Place, dès le vestibule, les ouvriers des campagnes; vous, pionniers paci