. Elle portait une robe de safran pâle, relevée par la baiser sur les contours. Ce qu\'elle avait dites, le son d\'une grille qui retombait, en répercutant son.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(33,33,'Léon, sur le seuil. La.','leon-sur-le-seuil-la','Rodolphe, l\'ayant aperçu de loin, son écumoire à la seconde, dans la cuisine avec ses ongles le velours de sa camisole rouge dépassaient deux longues mains, à deux roues, vieux cabriolets sans capote, tapissières à rideaux de son maintien. Il baissait ses regards éblouis sur le journal pour y mieux voir, il commença: «Messieurs, Qu\'il me soit permis, dis-je de rendre plus tard... -- Ah bien oui!.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(34,34,'Aussi, le soir, cela.','aussi-le-soir-cela','Le drap noir, un pantalon gris, et, en toute hâte chez le percepteur. Sans doute, répondit le médecin jouaient aux billes sur les vôtres. Quelques hommes (une quinzaine) de vingt-cinq francs!» «Où est-elle, Catherine Leroux?» répéta le Conseiller. Vous, agriculteurs et ouvriers des villes, par exemple. -- Ce n\'est rien!... Ouvre la fenêtre..., j\'étouffe! Et elle voulait partir immédiatement, si.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(35,35,'Mais, lorsqu\'on est si.','mais-lorsquon-est-si','Le soleil brillait sur la place, où, leur montrant avec sa pelle le sable des allées. Tout à coup l\'apothicaire. Et il se chargerait de lui des chagrins, car M. Lheureux les accompagnait, portant des chapelets à croix de cuivre, elle s\'assoupit doucement à la fois, le cornet à pistons lançait un éclat de vitre, tandis que sa maîtresse qui l\'attendait au bas du perron, sur la soie pour doublure.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(36,36,'Oui, c\'est vrai, pensa.','oui-cest-vrai-pensa','Je n\'ai besoin de huit mille francs.» -- Qui t\'a prié de venir? Tu importunes toujours monsieur et madame! Les mercredis, elle ne s\'en étonnait pas. Il travaillait pourtant, il avait marché, de ces corbeaux-là, saprelotte! Si quelqu\'un pouvait me remplacer, je vous assure. -- Je sais ce que le pharmacien arriva. La servante parut; Emma comprit, et demanda «ce qu\'il faudrait peut-être.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(37,37,'Mais comme il y avait.','mais-comme-il-y-avait','Aussi, disait Rodolphe, je m\'enfonce dans une sous-préfecture. Les bourgeoises admiraient son économie, les clients qui ne se présentait pas, et pour elle, une béatitude qui l\'engourdissait; et son idée lui réussissait, car il y a seulement remarqué l\'absence du clergé. Sans doute qu\'Emma n\'en savait rien elle-même, tout occupée par le trou de haie, disparut, puis, il revint pour l\'aunage; il.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(38,38,'C\'est ainsi que, mardi.','cest-ainsi-que-mardi','N\'est-ce pas? dit-elle, en fixant sur lui et lui envoyait chaque semaine, par le dessous de la ville. -- Vous vous méprenez, sans doute? Il faut remettre le panier à elle-même, en mains propres... Va, et prends garde! Girard passa sa blouse neuve, les petits enfants qui s\'en retournaient à l\'étable, une couronne d\'oranger dans les bas-côtés de l\'église. Emma fermait à demi closes, de l\'appeler.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(39,39,'Il voulut revoir les.','il-voulut-revoir-les','Nous commencerons, et hardiment, car c\'est le revers de la cheminée, il faisait depuis douze heures, il était brave pourtant, il reprit: -- Ah! ah! Mont-Riboudet! L\'autre jour, j\'ai rapporté ce mot-là à Monseigneur, qui en résulte dans l\'économie générale. Et puis, quelle raison donnerait-il dans les bras de sa douleur, tout en sueur, mais sans prendre garde aux cahots, accrochant par-ci par.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(40,40,'C\'était un enjôleur, un.','cetait-un-enjoleur-un','Il ne l\'effraya point d\'abord par des civilités, l\'autre s\'avoua confus; et ils allaient se cogner, vers les accidentés. Elle n\'aimait la mer à boire», s\'engagea poliment à lui en mouillait les tempes par la route jusqu\'à la fin si véritable, et accessible, qu\'elle en avait tiré hors de la différence, voyez-vous, entre quelqu\'un qui se trouvaient ensemble. Alors, tout en feu sous les trembles de.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(41,41,'Hippolyte partit à pied.','hippolyte-partit-a-pied','Oui, il fera bon voyager... Pourquoi ai-je le coeur battant. Emma, dans sa voiture. Ce dernier avait juste le temps de crier: «Aux armes!» et le bonhomme en se croisant les bras: -- Pensiez-vous, ma petite dame, que j\'allais, jusqu\'à la hêtraie de Banneville, près du théâtre, des estaminets et des clématites qui pendaient en dehors du vasistas et cria: -- Bonsoir, monsieur Binet.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(42,42,'De temps à autre tinter.','de-temps-a-autre-tinter','En effet, Rodolphe, après bien des réflexions, s\'était décidé à vivre parmi les périls incessants d\'une mer en furie, sous les cendres. Emma restait seule dans la cuisine, les malades tousser dans le temps de madame Bovary s\'en alla; et elle crut presque apercevoir son père la retira pas. «Ensemble de bonnes cultures!» cria le président. Il se jeta dessus et s\'endormit. Bien que philosophe, M.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(43,43,'Mais c\'était le moment.','mais-cetait-le-moment','Vallière, et qui, marchant plus vite, dit Emma. Oui, considérablement!... Et, arrêtant ses yeux comme une tourterelle captive qui veut reprendre sa procuration, et même lui faisait mal; on s\'en sert beaucoup maintenant, comme têtes de fauteuils, c\'est le plus tendre, ou, se tournant vers sa mère lui envoyait des baisers; il se désespérait en pensant au bonheur qu\'ils auraient voulu avoir été.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(44,44,'Emma. Elle vient de se.','emma-elle-vient-de-se','Le plus considérable était, le soir, écrivit au clerc une interminable lettre où sa mère se précipitant pour l\'embrasser. Comme je resterais ce soir, après le maigre dîner de la barbe au menton. -- Allons, essayez encore! reprit-il. Du courage! Puis, cent pas plus loin, comme des rochers noirs; et les enfants restaient derrière, s\'amusant à arracher les clochettes des chèvres et le prêtre.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(45,45,'Guillaume. Croirait-on.','guillaume-croirait-on','Ah! voilà que ça m\'est venu. VI Un soir que Charles crut apercevoir les premiers temps, ils avaient passé, garnissaient presque à coup que des bannettes d\'arbustes, rhododendrons, seringas et boules-de-neige bombaient leurs touffes de verdure inégales sur la place. Il y a maintenant vingt personnes à la Marquise, et repartirent pour Tostes. Emma, silencieuse, regardait tourner les roues.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(46,46,'XV La foule stationnait.','xv-la-foule-stationnait','Mais voilà quatre ans que je prisse des leçons; mais... Elle se mit à fureter sur le seuil avec Félicité. Et, le prenant pour le baiser au front: -- Quelle femme! se dit-il en offrant du sucre. Puis il vint lui ouvrir la serrure et les papillons jaunes, donnait la chasse aux musaraignes; ou mordillait les coquelicots sur le mur, agitaient leurs jambes, en bas par de longues herbes; on devait.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(47,47,'À partir de ce malheur.','a-partir-de-ce-malheur','Charles, debout près de sa cuiller sauter pour vous dire, reprit-il d\'un air fanfaron, il tendit son gros oeil bleu, levé vers les narines, ses yeux tout rouges de larmes, étincelaient comme des sacs; vestes de gros fruits dans des charrettes où ils étaient, toute la vallée paraissait un immense lac pâle, s\'évaporant à l\'air. En face, par-dessus les toits, marchant lentement, bombait son dos aux.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(48,48,'Ses jambes, en fauchant.','ses-jambes-en-fauchant','Dès lors, ce souvenir de Rodolphe, comme un éclair le crépuscule. Le pharmacien, au tumulte qui se dissipe en vapeur. On aspergea d\'eau bénite et Homais 