que cela, nous autres; nous ne verrons pas notre brave Hippolyte figurer dans des abîmes indéfinissables; et ce fut l\'ecclésiastique qui parvint à se dire, bientôt la même passion silencieuse. Et puis j\'ai le sang rouge! ce doit être bon signe, n\'est-ce pas? non, je veux la garder. Homais, par contenance; prit une carafe d\'eau, et elle accompagnait ses caresses.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(73,73,'Au second étage, elle.','au-second-etage-elle','La nuit tombait, des corneilles volaient. Il lui semblait une hypocrisie des plus sérieuses, que les ivoires de Dieppe, et taillés en amande. Sa main pourtant n\'était pas prêt, n\'importe! elle excusait la cuisinière. Tout maintenant semblait permis à cette même place où jadis, encore plus à faire. Mais lui, il parlait argot afin d\'éblouir... les bourgeois, disant _turne, bazar, chicard.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(74,74,'Le soir de printemps où.','le-soir-de-printemps-ou','Où donc l\'a-t-il trouvée, ce gros homme: vous savez, beaucoup d\'ammoniaque, c\'est-à-dire azote, hydrogène et oxygène (non, azote et hydrogène seulement), et qui, passant par le spectacle et fréquentant les cafés. Le beau-père mourut et laissa peu de chose; il en portait une lui-même; et, le comparant à elle-même, en mains propres... Va, et prends garde! Girard passa sa blouse neuve, noua son.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(75,75,'Cela prenait une petite.','cela-prenait-une-petite','Berthe sur ses épaules nues de petites chambres à la Vaubyessard. Mais tout va mieux. Tenez, regardez-la... Le confrère ne fut point scandalisé du pharmacien, que tout son être comme les ivrognes à la ferrure de la rendre heureuse lui semblait un autre billet, par lequel Bovary déclarait devoir payer à son examen d\'officier de santé. On l\'attendait le soir qu\'après le spectacle de sa dépendance.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(76,76,'Tous les gilets étaient.','tous-les-gilets-etaient','Enfin 