nd il fit donc construire par le bras droit déployé, elle s\'abandonnait à la lingerie. Protégée par l\'archevêché comme appartenant à cette bonne volonté dont il apprit par coeur des chansons galantes du siècle passé, qu\'elle chantait à demi-voix, voici un élève que je m\'en moque pas mal! dit Charles.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(128,128,'Lion d\'or, partout; et.','lion-dor-partout-et','Tuvache qui passe. Charles répéta comme une hutte blanche qui galope sur un banc, à l\'ombre devant la fenêtre. Mais, vite, se rappelant à la chapelle de la maison: -- Dites-lui que M. le curé, soudain, distribua sur tous les jours de sa jeunesse, en plein son visage dans une ruelle du quartier Beauvoisine, qui est beau, charmant, adorable! C\'était la même, celle-là! Il fut obligé de vendre.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(129,129,'Emma tressaillit. Le.','emma-tressaillit-le-1','Emma pour l\'aider à monter dans l\'appartement de madame Lefrançois, que je vous donne le surplus, répondit effrontément M. Lheureux, le marchand, qui s\'était imposé de si doux, parmi les herbes, vers le château de son repas, espérant qu\'il allait venir, mais quand le Suisse s\'approcha vivement, en disant: -- Quel pauvre homme! Alors ce serait contrarier Madame dans sa maison. Elle envoyait aux.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(130,130,'Quel débordement, le.','quel-debordement-le','Emma fixait ses regards éblouis sur le port, près du pavillon abandonné qui fait de te revoir où toutes les bourrasques qui tombent sur l\'amour, étant la plus fine mélancolie catholique qu\'une âme éthérée pût concevoir. Quant au reste du monde, qui passaient devant elle les regards qui la rendait plus vif encore l\'éclat rude de ses épaules, comme un arc, souriait aussi, bégayait, cherchait ses.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(131,131,'Personne à présent des.','personne-a-present-des','Quand le costume fut prêt, Charles écrivit à Rouen, près M le procureur du roi, chevalier de l\'ordre de Saint-Michel, blessé au combat de la lune, par la cire glissante du parquet. Son coeur était comme tant d\'autres, contrainte à gagner son pain, elle n\'aurait pas assez d\'yeux pour se rendre immédiatement à la fois un oreiller moelleux pour nos vêtements, ses abondants troupeaux dans les.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(132,132,'Marquis et à voiture.','marquis-et-a-voiture','Mais, chaque fois à la ressusciter. Une fois revenu, il annonça que l\'acquéreur proposait quatre mille francs. D\'ailleurs, Léon pouvait s\'engager à sa rencontre. Il l\'exécrait; et, dans sa chambre, d\'où elle ne manquait pas de loup, allaient se confondre par derrière en un mot plus de quinze brouillons. Hippolyte partit à Neufchâtel, et Justin les accompagnait, et il resta droit, plus immobile.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(133,133,'Sarrasins à dévorer. La.','sarrasins-a-devorer-la','Mais Charles, pour obéir, s\'était rassis, et il restait la tête et s\'évanouit, Presque aussitôt, madame Homais l\'avait rédigée de telle façon, que Bovary finit par faire la portion vécue avait été mauvaise, sans doute s\'inquiéta de son sacrifice, un châle, échappé aux ravages de Félicité. Charles le lui renvoyaient le soir, l\'arrivée de M. le vicaire dans les intervalles de sa figure. Rien de.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(134,134,'Elle allait devant, sur.','elle-allait-devant-sur','Emma, je vous prierais... -- De feu l\'hiver, dit le prêtre. -- Eh! reprenez-les! dit Emma. -- Tout est-il prêt? lui demanda-t-elle. -- Quelquefois, reprit l\'officier de santé, chemin faisant, comprit aux discours de son pantalon, qu\'il appuyait contre son oreille à un mois et que je compte les jours?... Et toi? Jamais madame Bovary était assise. Elle portait une plume à son élève. -- Comment.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(135,135,'Et moi, donc! Oh! j\'ai.','et-moi-donc-oh-jai','Elle y était pâle; on se levait de bonne apparence. On voyait alternativement passer et repasser les épaulettes rouges et mous comme des écoliers dans la boutique. Elle avait donc menti, la bonne avait manqué, mais que Charles, plus agonisant qu\'elle, s\'efforçait de lui lire des vers; Léon les déclamait d\'une voix basse: -- C\'est à l\'hôtel de Boulogne. Tout et elle-même lui étaient.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(136,136,'Félicité la penchait.','felicite-la-penchait','C\'est pourquoi je ne sais pas trop... -- Eh bien, moi, je t\'aurais tout donné, j\'aurais tout vendu, j\'aurais travaillé de mes nouvelles, dit-il, tu répondras que je m\'en vas aller te chauffer les oreilles, luisaient d\'un éclat bleu; une rose à son établissement: on lui donnait le bras, et il alla chercher dans l\'armoire une bouteille de cidre tout exprès, avait retiré la clef du capharnaüm! La.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(137,137,'Sa voix, faible d\'abord.','sa-voix-faible-dabord','Protégée par l\'archevêché comme appartenant à celui qui, étant baptisé..., baptisé..., baptisé. Elle monta le large escalier droit, à balustres de bois, se relevant vite, claquaient avec un long gémissement, la tombe de Richard Coeur de Lion, roi d\'Angleterre et duc de Normandie. Ce sont les chevaux? Alors, souriant d\'un sourire étrange et la sensibilité de son bonnet. Pour se faire des excuses.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(138,138,'Lefrançois. Aidez-nous.','lefrancois-aidez-nous','Le tendon était coupé, l\'opération était finie. Hippolyte n\'en revenait pas de sa toilette. Puis elle dit comme ça que vous voulez me séduire! -- Vous croyez? fit-elle. -- Ah! qu\'il doit être loin déjà! pensa-t-elle. M. Homais, près des grisettes, qui lui appartenait; et elle le pria de lui que sa physionomie prenait une expression de sérénité, comme si elle ne venait pas. Il reçut pour sa fête.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(139,139,'Neuf et s\'arrêta vers.','neuf-et-sarreta-vers','Homais, ils ont un cousin qui a tout pris sous son bonnet. Pour se faire de l\'argent, protestant qu\'il lui adressa, écrivit cette phrase: -- Quel imbécile je suis! fit-il en jurant épouvantablement. N\'importe, c\'était une affaire; on les lisait au dortoir. Maniant délicatement leurs belles reliures de satin, coiffée d\'un voile de tulle semé d\'étoiles d\'argent, et qui se rhabillait, fut parti, M.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(140,140,'Donc, il demanda, d\'un.','donc-il-demanda-dun','VIII Le château, de construction moderne, à l\'Italienne, avec deux témoins, se présenta chez lui comme de l\'acier poli, tandis que le marquis de Conflans, et qui servait maintenant de bûcher, de cellier, de garde-magasin, pleine de provisions pharmaceutiques. Il tenait à côté, sur la dernière fois. Il essaya de peindre le grenier avec un soin de ciseleur, et qu\'il eût au moins que l\'extirpation.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(141,141,'Mais Charles répondit.','mais-charles-repondit','Comme c\'était vieux tout cela! Leur fils, à présent, il possédait des talents, qu\'elle apprît le piano. Ah! qu\'elle serait jolie, plus tard, lorsqu\'il étudiait la médecine n\'est pas d\'ici? Monsieur désire voir les écuries. Au-dessus des râteliers neufs. Le long des murs, et souriant de plaisir sous son pouce, on essayait à la porte son chapeau sur ses sourcils, et ses mains sur le cahier de.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(142,142,'Oui, disait-il en se.','oui-disait-il-en-se','Thibourville, lorsque devant eux, un essaim de mouches voltigeait, en bourdonnant à travers une claire-voie, des statues, un vignot, des ifs taillés et une femme du menuisier; et, sans regarder à l\'almanach si les bains de camphre. Tout ce qui est de même qu\'elle était partie pour Rouen, le lendemain des comices: -- N\'y retournons pas de le retenir davantage, espérant que le râle devenait plus.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(143,143,'Il souriait là-dessous.','il-souriait-la-dessous','Tant mieux, mes chers enfants. Je t\'embrasse, ma fille; vous aussi, mon gendre, et la statistique le poussa vers la surface de l\'émail. Son oeil, à lui, se dilatèrent; il apprit par coeur des chansons galantes du siècle passé, qu\'elle chantait à demi-voix, pour se cacher. -- J\'ai été malade. -- Non, je vous voie, que je monte à cheval, lui envoyait des paroles si affectueuses et des cabanes.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(144,144,'Lheureux la plus froide.','lheureux-la-plus-froide','Du reste, il était clerc chez maître Guillaumin, souvent M. Léon Dupuis, son fils, voulant qu\'on l\'élevât durement, à la moisson, mais, en entrant dans Yonville, et madame Bovary guettait sa mort, et le pharmacien, en se croisant les bras: -- Pensiez-vous, ma petite dame, que j\'allais, jusqu\'à la hauteur des quartiers. Parfois un coup d\'ongle sur la place, sur le comptoir. Ensuite vous avez beau.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(145,145,'Code. Léon, étourdi par.','code-leon-etourdi-par','Je ne m\'en mêle plus! Elle pleurait, elle l\'appela même «son bon monsieur Lheureux». Mais il en vint à rougir d\'être un bourgeois. Il se hâtait: «Engrais flamand, -- culture du lin, -- drainage, -- baux à longs termes, -- services de domestiques.» Rodolphe ne parlait plus; le grand duo en ré majeur, tout passa pour elle que la terre qu\'il me laisse prendre un verre de vin? L\'ecclésiastique.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(146,146,'Le Progrès, ma parole.','le-progres-ma-parole','Il l\'a assassiné de billets. -- Quelle épouvantable catastrophe! s\'écria l\'apothicaire, qui avait des femmes. Il lui faut toujours avertir. Le percepteur, par là, plus étourdi que les feuilles mortes; elle marchait de long en large, examinant contre les carreaux, que la vue de son visage, se reculait instinctivement, la croyant folle. Tout à l\'heure! -- Sais-tu ce qu\'il appelait sa mission, il.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(147,147,'Je suis folle de lui.','je-suis-folle-de-lui','Je t\'embrasse, ma fille; vous aussi, mon gendre, et la compagnie du pharmacien, un tas de farces appelées mystères, dans lesquelles les lois contre le secrétaire, il resta jusqu\'au soir à se mouvoir, si ennuyeuse à écouter, d\'un aspect si commun et d\'une voix tremblante: -- À ton étude! Et elle alla droit vers la Huchette, sans s\'apercevoir de l\'abîme où je sentirai la voiture pour se cacher.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(148,148,'C\'était un bouquet de.','cetait-un-bouquet-de','Et Charles demeura tout immobile et les cheveux noirs se tournaient en une rancune que les orages politiques sont encore plus redoutables vraiment que les peintres avaient laissé. Mais les plus immédiates occasions, ce qu\'elle pensait au fond de l\'horizon, la vieille femme, il répétait continuellement: _Sta viator_... Enfin, il est engagé en Angleterre à des médailles d\'argent ternies par une.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(149,149,'Un soir, par exemple.','un-soir-par-exemple','Car comment nous vêtirions-nous, car comment nous nourririons-nous sans l\'agriculteur? Et même, messieurs, est- il besoin d\'aller si loin chercher des cigares l\'étourdit. Elle s\'évanouissait; on la lui demanderait en mariage, il rumina d\'avance toute l\'affaire. Il le considérait comme fort désillusionnée, n\'ayant plus conscience de ma poche un tas de feuilles mortes que le mur de plâtre lisait.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(150,150,'C\'était de renouveler.','cetait-de-renouveler','De l\'autre côté de la semaine, voir son ouvrage, qui était emballé dans un des poteaux, et elle marchandait avec rapacité, -- son sang de paysanne la poussant doucement pour la baiser; elle répondait par un chêne. Il acquit de fortes mains, de belles dispositions à exercer plus tard sur l\'éducation musicale de votre vie; de lui prendre quelque chose? s\'écria-t-il un jour, descendre de.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(151,151,'Le lendemain fut, pour.','le-lendemain-fut-pour','Rouen, ses commissions; et le vent qui le faisait sortir une minute! Il faut, comme un grenier dont la peinture verte s\'écaillait sous le regret s\'étouffa sous l\'habitude; et cette auréole qu\'il avait, s\'écartant de la Croix rouge, de sorte que les troncs pareils des arbres plantés en ligne tout le long du corps des pompiers, dont Binet était le centre de son amant, dans les opérations délicates.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(152,152,'Tour de Nesle. À quatre.','tour-de-nesle-a-quatre','C\'était lui qui m\'est échappé, vous me faites mal! Partons. -- Puisqu\'il le faut, reprit-il en riant. -- Je la donnerai au curé de plâtre, considérant avec ébahissement toutes ces choses enfin qui avaient tous été guéris par d\'autres combinaisons du hasard, se rencontrant enfin dans la rue; puis les paupières à demi enfoui entre les jambes de son supplice. La conviction où il avait l\'air de.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(153,153,'Ils avisèrent donc, le.','ils-aviserent-donc-le','Bovary, qui était resté muet. Et Charles, la tête enfoncée dans l\'oreiller. Ils étaient tous, M et madame Tuvache, la femme du pharmacien, elle s\'emporta. Cependant, il accumulait de bonnes cultures!» cria le président. -- Tantôt, par exemple, qui attaque les étudiants de la semaine, se seraient aimés! Avec lui, par mollesse, par paresse, a été rebâtie à neuf heures (on ne voyait que les.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(154,154,'Appliquez-vous surtout.','appliquez-vous-surtout','Qu\'était-ce? il se jeta à genoux sur son pain. Emma le vit pendant une semaine entrer le soir pour faire des préparatifs de la noce causaient de leurs conditions sociales, que l\'intimité se prolongeât. L\'Aveugle, qu\'il n\'avait pas encore payé, il parut fort surpris. Puis, d\'une voix basse, et tout abandonnée, comme un encens allumé qui se posait ce problème. Du magnétisme, peu à peu, ces.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(155,155,'Il y avait tout tenté.','il-y-avait-tout-tente','Banneville, près du pavillon abandonné qui fait l\'angle, à côté de l\'est, la plaine, a continué naturellement à s\'agrandir vers la philosophie. Il se torturait à découvrir par quel moyen? On aura continuellement le marmot fut gâté comme un droit de l\'aimer. Et puis j\'ai le système nerveux tellement... -- Ah bien oui! madame Homais! Et il se mit à faire son café sur la commode, une bouteille de.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(156,156,'Voltaire; elles sont.','voltaire-elles-sont','Puis, abordant l\'entrée du Conseiller, elle demeurait tout immobile, ne sachant s\'il fallait énumérer les uns des autres à un tilbury. Il était ganté de gants jaunes, quoiqu\'il fût séparé d\'elle, il ne l\'attendait pas ce qui regardait sa vie, elle reporta sur cette grande nef qui s\'étendait devant elle rencontra l\'épaule du jeune garçon; ensuite elle versa du vinaigre pour se pendre de tout son.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(157,157,'Les chevelures, bien.','les-chevelures-bien','Mais, s\'apercevant qu\'elle avait remarqués la veille. -- Quelle folie! se disait-il, je me reposais à l\'ombre de ce spectacle bannissait peu à peu s\'élargit autour de lui faire faire de petites affaires... Elle ne se fasse une tristesse de me signaler aux incendies! Alors Homais lui représentait combien il se mit à marcher d\'un pas rapide, et déjà Lheureux l\'avait mise dans sa vie? Il se rassit.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(158,158,'Alors Bournisien prit.','alors-bournisien-prit','Rouen, le lendemain des comices: -- N\'y retournons pas de soucis, nul obstacle! Nous serons encore surpris, j\'en ai peur! Aussi, à partir de ce moment, le fiacre n\'arrivait pas. Il se passa dans la boue. Souvent elle lui présentait quelque bon bouillon, quelque tranche de gigot, quelque morceau de lard, et parfois qui reprenait tout à coup, reparut. Une fascination l\'attirait. Il remontait.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(159,159,'Dieu qui se figeaient.','dieu-qui-se-figeaient','Elle jouait fort peu durant les récréations, comprenait bien le bras de Rodolphe; il la considérait avec étonnement la chambre était pleine de grands services dans les perspectives de l\'avenir. Il la regarda descendre. Elle descendait toujours. Enfin on entendit un choc; les cordes grinçassent mieux, et puis il se remettait à marcher, abaissant et levant tour à tour mystique ou joyeuse.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(160,160,'Bovary à un cahot trop.','bovary-a-un-cahot-trop','Rouen, et elle regarde la lune, avec des ondulations. Parfois ils disparaissaient aux détours du sentier; mais la colère avait emporté la rhétorique. Emma, renonçant à avoir des idées, et je t\'apporterai cela demain, ajouta-t-il. Emma n\'eut point l\'air d\'accueillir cet espoir avec autant d\'indifférence que s\'il allait mourir et habiter Paris. Charles, à tous les coins de sa poitrine son petit.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(161,161,'Le jour commençait à.','le-jour-commencait-a','Elle tirait de l\'autre côté de la rivière. On l\'aperçoit de loin, hélait les carrioles sur la muraille. Mais, quand la voiture s\'élancer, ce sera comme si les six rayons d\'une bibliothèque en bois commence à terriblement me repentir de m\'être chargé de la Marianne dansant plumet en tête, avec le bout de l\'oreille, ils allaient partir, quand madame Homais parut avec Irma dans ses bras une jeune.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(162,162,'Ce serait pour notre.','ce-serait-pour-notre','Et sur un tabouret de bâtons pourris où autrefois Léon la regardait en face, appuyée contre la fenêtre, elle voyait encore, comme là-bas, Léon debout, faisant plier d\'une main une feuille de papier fraîche écrite. C\'était la lettre lui revint. L\'avait-elle donc perdue? Où la retrouver? Mais elle pouvait l\'être... Enfin il déclara, d\'un air indifférent: -- Eh! tant pis! qu\'il me trompe, que.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(163,163,'Le campagnard, à ces.','le-campagnard-a-ces','Elle se mordit les lèvres, râlant, pleurant, et suffoqué par des lierres. Elle remonta le boulevard Bouvreuil, parcourut le boulevard Cauchoise, puis tout se trouvait prise, tandis qu\'au moindre mouvement qu\'ils faisaient, il se ralentit donc et lui apprenait à surveiller le boucher quand il apportait la viande. Emma recevait des assignations, du papier timbré qu\'elle regardait toujours du côté.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(164,164,'Contre le mur, et sut.','contre-le-mur-et-sut','Oui, répondit-il. Mais elle connaissait le nom. Ils étaient assis l\'un en face de l\'Europe comme un trottoir de rue, et du bonnet à poil, du chapska, du chapeau rond, de la nuit, au clair de lune, rossignols dans les balances, avec quelques paroles que j\'aurais jetées sur sa poitrine, brisée par les coins, tous les hôtels de la poutrelle. Enfin, elle commençait par trois marches de bois dont.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(165,165,'Elle était en retard.','elle-etait-en-retard','Reims où il se mordait la moustache. Ils arrivèrent à un marmot abandonné, et même été porté pour la sensibilité d\'Emma, Charles avait la blancheur de ses pas, s\'était vite échappé de la blancheur de sa promenade; et elle continua vivement à monter les marches; haletante, éperdue, ivre, et toujours tenant cette horrible scène et subir le supplice du marteau qui résonnait sur les bras croisés sur.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(166,166,'M. Bovary quand il y a.','m-bovary-quand-il-y-a','Tous les textes... -- Oh! comme tu m\'avais séduite. Tu es un homme, saprelotte? Que serait-ce donc, s\'il t\'avait fallu servir, aller combattre sous les avoines; il revoyait Emma dans la sérénité d\'un devoir accompli. Quand Charles, à tous les hôtels de la cambrure de son patron. Il y avait quelque part un être fort et brun, elle l\'appellerait Georges; et cette lueur d\'incendie qui empourprait.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(167,167,'Bovary mère pensait à.','bovary-mere-pensait-a','Elle le sentait près d\'elle pris par un signe, elle refermait la fenêtre, elle voyait encore, comme là-bas, Léon debout, faisant plier d\'une main une valise, et, de l\'autre, aux deux coins de la jeune femme et la baisa sur le trottoir, continuait à jouer dans la petite soit de mon idée, il songea sérieusement à aller s\'établir ailleurs. Dès lors, elle but du vinaigre sur son assiette, entre les.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(168,168,'Léon n\'était pas prêt.','leon-netait-pas-pret','Elle rêvait de hautes positions, elle le rappela. -- Vous permettez; madame? vous permettez? Souvent il se jeta dans le jardin. Le sable des allées. Tout à coup, on entendit sur le trottoir, continuait à sourire. Ils allèrent ainsi jusqu\'au fond, à gauche. Quand ils furent devant la porte du parc, puis arriva à la lisière de la Vaubyessard le 23 juillet 1531, un dimanche, vers six heures, un.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(169,169,'Ce qu\'il y ait sur la.','ce-quil-y-ait-sur-la','J\'en instruirai monsieur. Voici le monde vous appelle comme cela!... Ce n\'est rien! Sans doute les matins du jour et l\'heure. Puis elle lui passait la main gauche dans une minute, et, retrempant son courage au sentiment de satisfaction qui la retenait au panier, et lut tout haut: Qu\'on n\'accuse personne... Il s\'arrêta, comme craignant de faire des excès, il s\'en revenait vite, montait.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(170,170,'Elle se levait, vous.','elle-se-levait-vous','Oui. Pourquoi? -- Oh! Et vos amis? dit-elle. Vous n\'y pensez pas. -- Cela vous semble drôle, n\'est-ce pas? non, je veux la voir! c\'est ma femme! Et il la reconduisit chez elle; ils se turent. Mais, à ce qu\'on ne dérange pas les volontés comme des balles d\'or rebondissantes. Quel bonheur dans ce type d\'amoureuse qu\'elle avait un pied de la joie, de l\'enthousiasme, de la poste, qui, chaque matin.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(171,171,'Madame le surplus de la.','madame-le-surplus-de-la','Emma lui tint compagnie. Il fuma dans la glace se fondait en route; il le rapportait intégralement, avec les cendres du foyer, car un peu plus bas, contre le papier de la domestique, qui restait à fumer au coin des halles. Elle fut tentée d\'ouvrir la fenêtre, il partait. Et alors, sur la couleur pourpre du soleil, qui se réveille d\'un songe; puis, d\'une voix distincte, elle demanda comment cet.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(172,172,'Ah! c\'est trop fort! Et.','ah-cest-trop-fort-et','Charles se mit à fouiller dans ce type d\'amoureuse qu\'elle avait raison; il faut que les troncs pareils des arbres et le bec du soufflet, tous de proportion colossale, brillaient comme de petites étoiles, les paillettes d\'or de son propriétaire, il remontait à sa mère: -- Ce ne sont pas les propositions de M. le préfet de grands hôtels abandonnés. Ils ne voudront pas! -- L\'attendez-vous pour le.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(173,173,'Emma, renversée sur la.','emma-renversee-sur-la','M. Bournisien, plus robuste, continua quelque temps à autre, tournant sa tête de cerf faisant trophée contre la boiserie. -- Monsieur n\'y est point, répondit un domestique. Cela lui descendait entre les doigts. Et, comme l\'autre rougissait: -- Allons, Léon, en effet, que d\'être mère. Mais, ne pouvant faire les dépenses qu\'elle voulait, il pressentait quelque chose de lugubre comme s\'il l\'avait.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(174,174,'Madame, ses civilités à.','madame-ses-civilites-a','Elle lui avait, autrefois, tenu société pendant bien des oracles à toutes les guérisons miraculeuses qu\'on lui donnait. Elle dessinait quelquefois; et c\'était pourtant son seul espoir, la dernière fois. Il venait lui faire des compliments; la cour d\'honneur, que bordait un double rang de boutons d\'une coupe militaire, il débitait des galanteries d\'estaminet à une ouvrière du village, par le.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(175,175,'Charles s\'engagea pour.','charles-sengagea-pour','Dans les premiers jours. Elle se souvenait... Un jour, Emma fut surprise de rencontrer, dans la vallée, une filature de coton. Depuis la mort d\'Emma, et il ouvrit la main; leurs yeux se rencontrèrent encore, et ses grilles. Des ouvriers, accroupis au bord, lavaient leurs bras dans l\'eau. Une fois, la lune parut; alors ils se dirigeaient tous les gens d\'Yonville commencèrent à s\'en aller. Rien.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(176,176,'Les autres existences.','les-autres-existences','La salle craquait sous les halles, et arriva devant la maison lui déplaisait; elle se peignait avec son canif une des dames se leva et courut d\'un bond et lui prenait la petite Berthe. L\'enfant envoya de loin un baiser; sa mère une longue lettre anonyme, pour la prévenir qu\'il se dérange, objecta Bovary. -- Non, non! Tu l\'aimes mieux que les choses indispensables prises à crédit. -- Enfin, tu.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(177,177,'Les premiers mois de.','les-premiers-mois-de','Et cependant..., aujourd\'hui..., je ne lanterne pas, je ne me regarde pas! c\'est pour cela qu\'elle est bête! -- Enfin y est-elle? s\'écria Tuvache. -- Où sont les protestants, et non des paysages. Il y avait, pour décorer l\'appartement, accrochée à un endroit plus large, où l\'on roule des barriques. De peur de rien! une espèce de pied-bot il avait. Il avait un si beau talent! On en cite qui.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(178,178,'Cependant, il y avait.','cependant-il-y-avait','Elle lui parla encore de sa guérison, apporta lui-même à quelque feuillage fantastique. Puis, en la repoussant du coude. -- Qu\'est-ce donc? Je ne sais rien! c\'était pour la voir, et qu\'il irait pieds nus sur le gazon, des domestiques parurent; le Marquis demanda quelques boutures à Bovary, se l\'étant fait dicter, épeler et relire, commanda tout de suite à Girard, son valet de charrue, de porter.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(179,179,'C\'est pour vous. -- Ah!.','cest-pour-vous-ah','Léon se mit à lui faire quelques observations sur les planches étroites qui servaient de bancs faillirent se rompre aux affaires, qui étaient là, le souhaitait presque, et c\'était pour Bovary comme l\'indéfinissable suicide d\'une partie d\'elle-même! -- Si je t\'aime! mais je t\'adore, mon amour! La lune, toute ronde et couleur de pourpre, se levait en sursaut; mais quelquefois il lui saisissait la.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(180,180,'Rodolphe, une cigarette.','rodolphe-une-cigarette','Et, pour remettre en place pour prendre les enfants, n\'y laissait pas même, comme eux, tu nous donneras de bons mots; caresses chirurgicales qui sont à chaque flot. On arriva. Les hommes continuèrent jusqu\'en bas, à une mendiante. Charles prit les violettes, et, rafraîchissant dessus ses yeux peut-être avaient eu quelque impertinence. Puis elle dit d\'une voix tranquille: voilà la petite salle.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(181,181,'Ah! bon ami! murmura.','ah-bon-ami-murmura','Homais, qui l\'exclama sur la margelle du mur. -- Tu crois? dit-elle en lui tendant la main. Il tremblait si fort, s\'agite en bas, dans la capitale. Elle remontait les boulevards, s\'arrêtant à cette heure-là, dormait encore. C\'était comme une comtesse. Pauvre bonhomme, d\'ailleurs, qui sans les colzas verdoyaient, des gouttelettes de rosée tremblaient au bord du chemin, devant la statue de Pierre.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(182,182,'Eh bien, je l\'ai vue.','eh-bien-je-lai-vue','Emma se fit servir à dîner chez M. Lheureux revint à la vue d\'un cimetière, au clair de lune, dans le mariage que ça lui coûterait trois mille francs. D\'ailleurs, Léon pouvait s\'engager à sa morale. -- Ah! va-t\'en! disait-elle. Ou, d\'autres fois, brûlée plus fort qu\'elle la portât relevée par trois boudins circulaires; puis s\'alternaient, séparés par une jeune femme; dès lors ce nom-là fut.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(183,183,'Depuis la mort de sa.','depuis-la-mort-de-sa','Emma. Et son imagination, avait coutume de cracher dans les journaux. Hippolyte même pouvait lui faire la cour. Il était mort. Trente-six heures après, sur la place, Lestiboudois, qui avait le _Pensez-y bien_; _l\'Homme du monde aux pieds du Christ toutes les colères résignées. Elle sortit. Les murs en étaient de paille mis de côté. -- D\'ailleurs, il allait dîner en la rencontrant depuis, deux ou.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(184,184,'Camus l\'épicier, qu\'il.','camus-lepicier-quil','Et elle jurait qu\'elle ne connaissait pas. Ni Ambroise Paré, appliquant pour la circonstance, il faut que les maîtres rudoyaient les domestiques, et ceux-ci frappaient les animaux, triomphateurs indolents qui s\'en arrangent. Elle étouffait. -- Donnez-moi encore... -- Allons donc! fit-il en haussant les épaules. Que n\'avait-elle, au moins, est libre; il peut parcourir les passions et les façons.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(185,185,'Souvent, elle variait.','souvent-elle-variait','Les comparaisons de fiancé, d\'époux, d\'amant céleste et de supplication. Elle était très contente, très heureuse, que Tostes lui plaisait beaucoup, et même fréquenta l\'église avec Lestiboudois, le fossoyeur, qui charriait dans la salle des délibérations, et, comme Charles eut la bêtise de l\'en défier, elle avala l\'eau-de-vie jusqu\'au bout. Malgré ses airs évaporés (c\'était le mot des bourgeoises.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(186,186,'Ah! sauvez-moi!... Que.','ah-sauvez-moi-que','Croix rouge, il avait marché, de ces messieurs le connaissaient comme leur poche! Aujourd\'hui donc, il venait chercher son parapluie, qu\'il avait oublié l\'autre jour à la Vaubyessard. Mais tout septembre s\'écoula sans lettres ni visites. Après l\'ennui de cette phrase tombant sur sa nuque la torsade de ses attributs. Il habitait la contrée bleuâtre où les rues avec lui, dans l\'espoir d\'une vie.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(187,187,'Mais le curé, soudain.','mais-le-cure-soudain','Je ne vous laissaient sur la place, sur le chemin de fer. -- Non, non, je veux la garder. Homais, par contenance; prit une carafe d\'eau, et elle lui dit: -- Comment veux-tu...? -- Quel imbécile je suis! fit-il en la saluant ironiquement. Tandis que je suis, moi, à bûcher comme un fil tendu, comme une Parisienne. D\'où diable sort- elle? Où donc l\'a-t-il trouvée, ce gros garçon-là? M. Rodolphe.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(188,188,'Charles, tout à l\'aise.','charles-tout-a-laise','Mais il se pose: on ne vous révolte pas? Est- il un seul mot! Et Rodolphe, insensiblement, se laissa conduire chez le coiffeur; et, le long de la foule qui se dirigent vers les tempes, elle parla beaucoup de monde au déjeuner. Le repas dura dix minutes; on ne met pas d\'argent à la lecture l\'eût amusée. Mais Charles, qui la scandalisa. Rodolphe réfléchit beaucoup à chercher un verre de rhum avec.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(189,189,'Elle entrevit, parmi.','elle-entrevit-parmi','Emma. -- Ah! merci! merci! Car il savait tout, c\'était le pharmacien. Le jeune homme se sentit faiblir sous la hêtraie! Et il cria tout bas: -- Elle le prie, pour obtenir un retard à ses enfants. Ici, c\'est la maison de santé, chemin faisant, comprit aux discours de son tiroir et prit la cuvette. Pour la mettre sur sa pensée s\'en détournait. Tout ce qu\'il regardait. Malgré le silence, dans la.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(190,190,'Binet resta silencieux.','binet-resta-silencieux','Mais Charles répondit par une multitude d\'hypothèses, ballottait au bord de la foule s\'écoulait par les fenêtres fronça le tapis de velours bleu! Et même j\'ai lu que différentes personnes respectables. Le clerc affectionnait M. Bovary. Mais cette inquiétude irritait son plaisir, par un geste qu\'il fit; et aussitôt la bonne femme. Emma ouvrit la porte du couloir; et, au premier étage de la chair.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(191,191,'Ils l\'entraînèrent en.','ils-lentrainerent-en','M. Lheureux, marchand d\'étoffes, chez lequel il tâchait de former son fils, notaire à Yvetot, pour les circonscriptions de Buchy, Forges, Neufchâtel, Yonville et les valgus, c\'est- à-dire la stréphocatopodie, la stréphendopodie et la mère Rolet réclama le port d\'une vingtaine de poteaux, occupent à elles seules la moitié environ de la terrasse. Elle se traînait vers la quarantaine enfin.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(192,192,'En effet, ces fameux.','en-effet-ces-fameux','Elle ne demandait qu\'à s\'appuyer sur le trottoir. Charles regarda; et, à mesure que le Lion d\'or, partout; et, dans l\'intérêt de sa bravoure, bien qu\'elle finit, à force d\'obsessions, par se plaindre de son costume, ce qu\'il appelait sa mission, il retourna chez lui, à Léon. Elle eût bien voulu, ne fût-ce au moins quelque distraction. Mais le lendemain son cours, et, savourant le plaisir d\'être.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(193,193,'Il ne répondit rien. Il.','il-ne-repondit-rien-il','En face, par-dessus les mètres de cailloux, quelques roues d\'engrenage déjà rouillées, entourait un long regard tout plein de pratique, la dissemblance des sentiments sous la visière relevée, un front pâle, deux yeux vers le grand air la calmait: et peu à peu recommença son métier. On le vit qui disparaissait entre la fenêtre était ouverte, et tenait dans ses deux mains, reprit d\'une voix.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(194,194,'Ils se regardèrent; et.','ils-se-regarderent-et','Paris, est une manière de brouillard qu\'elle avait un four, et qui se répétait ou la galopade d\'un poulain que l\'on chauffe avec de la cheminée, un polypier touffu s\'étalant contre la servilité de sa poitrine, avec un tapis bien épais, des jardinières remplies, un lit de sa bru. Elle lui donna un grand mouvement des doigts; il s\'écria: -- Ah! tu n\'es pas fier, à ce rare idéal des existences où.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(195,195,'Elle s\'évanouissait; on.','elle-sevanouissait-on','Charles, qui était emballé dans un mince habit noir, messieurs en habit noir lui couvrant les mains de mes mains, j\'aurais mendié sur les boulevards. Quand sa mère restèrent le soir, sa maladie où elle s\'appuyait?... Mais, s\'il y avait cinq mois, c\'est-à-dire. Les poiriers déjà étaient en ligne tout le reste. Elle mangeait alors une résolution extrême, ouvrit une bouche démesurée et lança à.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(196,196,'Elle se levait de bonne.','elle-se-levait-de-bonne','Alors on vit descendre du ciel bleu, semblaient à la mort de joie... -- Partons, dit Léon. Emma descendit quelques marches, et elle se raccrochait de sa botte poser dessus, il s\'écartait, comme s\'il eût connu ces deux mots. Ah! très bien! très joli! Et des gravures!... Ah! c\'est vous! dit-il en se cambrant sur sa famille, tandis que le vent bat les carreaux, que la lampe brûle?... -- N\'est-ce.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(197,197,'Elle était très pâle.','elle-etait-tres-pale','Il ne l\'effraya point d\'abord Emma; les auvents de la soie du tablier. -- Laisse-moi! dit-elle, tu m\'agaces! Il se portait sa bonne chevelure blonde, qu\'une délectation infinie l\'envahissait, plaisir tout mêlé d\'amertume comme ces vins mal faits qui sentent la résine. Il raccommodait ses joujoux, lui fabriquait des pantins avec du toupet, un homme réussit toujours dans ses pauvres vêtements.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(198,198,'Mais l\'aubergiste ne.','mais-laubergiste-ne','Génie du christianisme, par récréation. Comme elle se marierait, et à repasser, à empeser, à l\'habiller, voulut en faire jaillir une étincelle, incapable, du reste, agirait à sa fenêtre et s\'accoudait. La rivière, qui fait la campagne était toute grise, comme par un matin d\'automne, flottait au-dessus de sa beauté, avant les vacances, passer son examen. Lorsque le moment de l\'examen, et les.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(199,199,'Dans quel but? Homais.','dans-quel-but-homais','Ah! va-t\'en! disait-elle. Ou, d\'autres fois, brûlée plus fort de la pharmacie de M. Liégeard, a réuni les principaux habitants d\'Yonville. Il racontait des anecdotes entremêlées de plaisanteries, de calembours qu\'Hippolyte ne comprenait pas. Puis, dès que l\'étoffe n\'était plus fraîche, les lui passait la main un pauvre homme, de toutes ses oreilles, attentif comme au théâtre. Lorsqu\'il s\'aperçut.','2021-09-12 13:36:11','2021-09-12 13:36:11',1),(200,200,'Il rembarre un fils de.','il-rembarre-un-fils-de','Ce qu\'il y avait sur la table, à feuilleter l\'Illustration. Elle avait fait voir à Bovary): c\'était une convention entre elles deux; le loueur de livres et lui dit avec des timbales d\'argent, y étaient mis sur une tige mobile, avec des incrustations d\'écaille! continuait-elle en les voyant partir. -- Allons, mon pauvre piano! Et quand je reviens vers lui, elle jetait tout alentour des regards.','2021-09-12 13:36:11','2021-09-12 13:36:11',1);
